INSERT INTO `vulnerabilities` VALUES (824, 'H2 Database Console 未授权访问', '', '', 'high', '命令执行', '<p style=\"text-align:start;text-indent:2em;\"></p><p>H2 database是一款Java内存数据库，多用于单元测试。H2 database自带一个Web管理页面，在Spirng开发中，如果我们设置如下选项，即可允许外部用户访问Web管理页面，且没有鉴权：</p><p>spring.h2.console.enabled=true<br/>spring.h2.console.settings.web-allow-others=true<br/>攻击者利用这个管理页面可以进行JNDI注入攻击，进而在目标环境下执行任意命令。</p>', '<p>1.建议受影响的用户升级至官方最新版本</p><p></p><p>2.未能及时安装新版的，可限制只允许可信源IP访问</p>', 'JAVA', 2);
INSERT INTO `vulnerabilities` VALUES (825, '深信服EDR 远程代码执行漏洞', NULL, NULL, 'high', '命令执行', '<p><span style=\"color:#333333\"><span style=\"\"><span style=\"letter-spacing:0.544px\"><span style=\"background-color:#ffffff\">终端检测响应平台（EDR）存在远程代码执行漏洞，经过追踪确认该漏洞真实存在，建议尽快处置。</span></span></span></span></p>', '<p>1.将EDR部署于内网，不要对公网开放，并在内网设置白名单。</p><p>2.联系厂商，更新版本，进行修复。</p>', 'PHP', NULL);
INSERT INTO `vulnerabilities` VALUES (826, 'Metinfo SQL注入漏洞 (CVE-2019-16997)', 'CVE-2019-16997', '', 'high', 'SQL 注入', '<p style=\"text-align:start;text-indent:2em;\"></p><p>MetInfo是中国米拓（MetInfo）公司的一套使用PHP和Mysql开发的内容管理系统（CMS）。Metinfo 7.0.0beta版本中存在SQL注入漏洞。该漏洞源于基于数据库的应用缺少对外部输入SQL语句的验证。攻击者可利用该漏洞执行非法SQL命令。</p>', '<p style=\"text-align:start;text-indent:2em;\"></p><p>目前厂商暂未发布修复措施解决此安全问题，建议使用此软件的用户随时关注厂商主页或参考网址以获取解决办法：<a href=\"https://www.metinfo.cn/\" target=\"_Blank\">https://www.metinfo.cn/</a></p>', 'PHP', 3);
INSERT INTO `vulnerabilities` VALUES (827, '深信服EDR 任意用户登录', NULL, NULL, 'high', '命令执行', '<p>深信服EDR设备任意用户登录，<span style=\"color:#4d4d4d\"><span style=\"\"><span style=\"background-color:#ffffff\">user后面任意填写都可直接登录，例https://127.0.0.1:443/web/login.php?user=admin</span></span></span></p>', '<p>1.建议受影响的用户升级至官方最新版本</p><p></p><p>2.未能及时安装新版的，可限制只允许可信源IP访问</p>', 'PHP', NULL);
INSERT INTO `vulnerabilities` VALUES (828, 'DedeCMS V5.7 下载重定向漏洞', '', '', 'middle', '未知', '<p><span style=\"color:#4d4d4d\"><span style=\"font-size:16px\"><span style=\"background-color:#ffffff\">Dedecms 5.7sp1的/plus/download.php接收参数后未进行域名的判断就进行了跳转。</span></span></span></p>', '<p>1.建议受影响的用户升级至官方最新版本</p><p></p><p>2.未能及时安装新版的，可限制只允许可信源IP访问</p>', 'PHP', NULL);
INSERT INTO `vulnerabilities` VALUES (829, '宝塔面板 pma 未授权访问', NULL, NULL, 'high', '配置错误', '<p style=\"text-align:start;text-indent:2em;\">宝塔Linux面板是提升运维效率的服务器管理软件，支持一键LAMP/LNMP/集群/监控/网站/FTP/数据库/JAVA等100多项服务器管理功能，已获得全球百万用户认可安装。</p><p style=\"text-align:start;text-indent:2em;\"></p><p style=\"text-align:start;text-indent:2em;\">宝塔 Linux 7.4.2 版本和Windows 6.8版本存在未授权访问漏洞，攻击者可通过访问特定URL直接访问数据库。成功利用此漏洞的攻击者可访问数据库中的数据，也可能进行一些危险操作。</p>', '<p style=\"text-align:start;text-indent:2em;\">请尽快更新至以下安全版本：</p><p style=\"text-align:start;text-indent:2em;\">宝塔Linux 7.4.2版本 -&gt; 宝塔Linux正式版 7.4.3</p><p style=\"text-align:start;text-indent:2em;\">宝塔Linux测试版本7.5.14 -&gt; 宝塔Linux测试版本7.5.15</p><p style=\"text-align:start;text-indent:2em;\">宝塔Windows 6.8版本 -&gt; 宝塔Windows 正式版6.9.0</p><p></p><p style=\"text-align:start;text-indent:2em;\"><strong>更新方法：</strong></p><p style=\"text-align:start;text-indent:2em;\">登录面板后台，右上角点击更新，弹窗后，点击立即更新。</p><p style=\"text-align:start;text-indent:2em;\"><strong>或者使用升级脚本</strong>（注意：优先在面板首页直接点更新，失败的情况下，才使用此命令，且不能在面板自带的SSH终端执行）：</p><p style=\"text-align:start;text-indent:2em;\">curl https://download.bt.cn/install/update_panel.sh|bash</p><p style=\"text-align:start;text-indent:2em;\"><strong>离线升级步骤：</strong></p><p style=\"text-align:start;text-indent:2em;\">1、下载离线升级包：http://download.bt.cn/install/update/LinuxPanel-7.4.3.zip</p><p style=\"text-align:start;text-indent:2em;\">2、将升级包上传到服务器中的/root目录</p><p style=\"text-align:start;text-indent:2em;\">3、解压文件：unzip LinuxPanel-7.4.3.zip</p><p style=\"text-align:start;text-indent:2em;\">4、切换到升级包目录：cd panel</p><p style=\"text-align:start;text-indent:2em;\">5、执行升级脚本：bash update.sh</p><p style=\"text-align:start;text-indent:2em;\">6、删除升级包：cd .. &amp;&amp; rm -f LinuxPanel-7.4.3.zip &amp;&amp; rm -rf panel</p>', 'Python', NULL);
INSERT INTO `vulnerabilities` VALUES (833, 'SolarWinds Orion 权限绕过漏洞 (CVE-2020-10148)', 'CVE-2020-10148', '', 'high', '命令执行', '<p style=\"text-align:start;text-indent:2em;\"></p><p><span style=\"color:#000000\"><span style=\"font-size:16px\"><span style=\"background-color:#ffffff\">SolarWinds Orion 平台中存在一处权限绕过漏洞。攻击者通过访问 WebResource.adx ， ScriptResource.adx ， i18n.ashx 或 Skipi18n 并传入特制的参数，导致SolarWinds错误的对该系列请求设置 SkipAuthorization 标志，绕过权限验证。最终通过访问功能性API，导致远程代码执行。</span></span></span></p>', '<p style=\"text-align:start;text-indent:2em;\"></p><p>通用修补建议：升级到 2020.2.1HF2 或 2019.4HF6。SolarWinds为商业软件，需联系官方获得相关技术支持 https://customerportal.solarwinds.com/。</p><p>临时修补建议：通过官方 powershell脚本 禁止外部对特殊路由的访问 https://downloads.solarwinds.com/solarwinds/Support/SupernovaMitigation.zip</p>', 'Any', NULL);
INSERT INTO `vulnerabilities` VALUES (834, 'LanProxy 路径遍历漏洞', 'CVE-2021-3019', 'CNNVD-202101-275', 'high', '目录遍历', '<p style=\"text-align:start;text-indent:2em;\"></p><p>lanproxy是Ffay个人开发者的一个可将局域网内服务代理到公网的内网穿透工具。</p><p>lanproxy 0.1 存在路径遍历漏洞，该漏洞允许目录遍历读取/../conf/config.properties来获取到内部网连接的凭据。</p>', '<p style=\"text-align:start;text-indent:2em;\"></p><p>目前厂商已发布升级补丁以修复漏洞，补丁获取链接：<a href=\"https://github.com/ffay/lanproxy/commits/master\" target=\"_Blank\">https://github.com/ffay/lanproxy/commits/master</a></p>', 'Any', NULL);
INSERT INTO `vulnerabilities` VALUES (840, 'Druid monitor 未授权访问', '', '', 'high', '信息泄漏', '<p>druid monitor 未授权访问，导致敏感信息泄露。</p><p></p>', '<p>相关页面加上访问控制。</p>', 'Any', NULL);
INSERT INTO `vulnerabilities` VALUES (841, 'Seacms v992 远程命令执行', '', '', 'high', '命令执行', '<p>Seacms v992 远程命令执行</p>', '<p>进行安全升级</p>', 'Any', NULL);
INSERT INTO `vulnerabilities` VALUES (842, 'Seacms v655 远程命令执行', '', '', 'high', '命令执行', '<p>Seacms v655 远程命令执行</p>', '<p>升级版本</p>', 'Any', NULL);
INSERT INTO `vulnerabilities` VALUES (843, '泛微 云桥 任意文件读取漏洞', NULL, NULL, 'high', '任意文件读取', '<p>泛微云桥是一个为了满足用户提出的阿里钉钉与泛微OA集成需求,近日,泛微与阿里钉钉工程师多方联合,集合内部研发力量共同完成的“泛微云桥e-bridge平台”，近日泛微云桥被曝出存在任意文件读取漏洞。</p>', '<p>去官网更新最新版本。</p>', 'Any', NULL);
INSERT INTO `vulnerabilities` VALUES (844, '用友 GRP-u8 远程命令执行漏洞', NULL, NULL, 'high', '命令执行', '<p style=\"text-align:start;text-indent:2em;\">用友GRP-U8R10行政事业财务管理软件是用友公司专注于国家电子政务事业，基于云计算技术所推出的新一代产品，是我国行政事业财务领域最专业的政府财务管理软件。</p><p style=\"text-align:start;text-indent:2em;\">该系统被曝存在命令执行漏洞，当用户可以控制命令执行函数中的参数时，将可注入恶意系统命令到正常命令中，造成命令执行攻击。</p>', '<p>联系厂商升级至最新版。</p>', 'JAVA', NULL);
INSERT INTO `vulnerabilities` VALUES (848, 'Weblogic Console 远程命令执行', 'CVE-2020-14882 CVE-2020-14883', 'CNVD-2020-59715', 'high', '命令执行', '<p>Oracle WebLogic Server是美国甲骨文（Oracle）公司的一款适用于云环境和传统环境的应用服务中间件，它提供了一个现代轻型开发平台，支持应用从开发到生产的整个生命周期管理，并简化了应用的部署和管理。</p><p></p><p>Oracle WebLogic Server Console 多版本存在安全漏洞，未经身份验证的攻击者可以通过HTTP访问网络，从而破坏Oracle WebLogic Server。</p>', '<p style=\"text-align:justify;text-indent:2em;\"></p><p><span style=\"color:#000000\"><span style=\"font-size:16px\"><span style=\"background-color:#ffffff\">目前官方已发布漏洞修复版本，建议用户升级到安全版本：https://www.oracle.com/security-alerts/cpuoct2020traditional.html。</span></span></span></p><p><span style=\"color:#000000\"><span style=\"font-size:16px\"><span style=\"background-color:#ffffff\">++</span></span></span></p><p><span style=\"color:#000000\">该补丁已被绕过，在不影响正常业务的情况下，建议暂时对外关闭后台 /console/console.portal 的访问权限。</span></p>', 'JAVA', NULL);
INSERT INTO `vulnerabilities` VALUES (849, 'Vmware Vcenter 任意文件读取', '', '', 'high', '任意文件读取', '<p style=\"text-align:left;text-indent:2em;\">VMware vCenter 存在一处任意文件读取漏洞。</p><p style=\"text-align:left;text-indent:2em;\">在 vCenter Web 服务的特定路径下，存在一个未经校验的外部可控参数，可直接传入任意文件路径并返回具体文件内容。</p><p style=\"text-align:left;text-indent:2em;\">远程攻击者通过访问开放在外部的 vCenter 控制台，可以任意读取主机上的文件。(可读取 vCenter 配置文件获得管理帐号密码)进而控制 vCenter 平台及其管理的虚拟机集群。</p>', '<p style=\"text-align:left;text-indent:2em;\" name=\"h3-6\" id=\"h3-6\">升级到最新版本。</p>', 'Any', NULL);
INSERT INTO `vulnerabilities` VALUES (851, 'Jira 信息泄露漏洞 (CVE-2020-14181)', 'CVE-2020-14181', '', 'low', '信息泄漏', '<p>Jira存在一个未授权访问漏洞，未授权的用户可以通过一个api接口直接查询到某用户名的存在情况，该接口不同于CVE-2019-8446和CVE-2019-3403的接口，是一个新的接口。如果Jira暴露在公网中，未授权用户就可以直接访问该接口爆破出潜在的用户名。</p>', '<p>目前厂商已发布升级补丁修复漏洞，请受影响用户尽快进行升级加固。补丁获取链接：https://www.atlassian.com/zh/software/jira/download</p>', 'Any', NULL);
INSERT INTO `vulnerabilities` VALUES (853, 'ThinkCMF 模板缓存 远程命令执行漏洞', '', '', 'high', '命令执行', '<p><span style=\"color:#333333\">webshell代码</span></p>', '<p>升级<span style=\"background-color:#ffffff\"><span style=\"color:#333333\">将 HomebaseController.class.php 和 AdminbaseController.class.php 类中 display 和 fetch 函数的修饰符改为 protected</span></span></p>', 'PHP', NULL);
INSERT INTO `vulnerabilities` VALUES (855, 'Citrix ADC XSS (CVE-2020-8191)', 'CVE-2020-8191', '', 'high', '跨站脚本(XSS)', '<p>允许在13.0-58.30、12.1-57.18、12.0-63.21、11.1-64.14和10.5-70.18之前的Citrix ADC和Citrix Gateway中进行不正确的输入验证，并允许11.1.1a，11.0.3d和10.2.7之前的Citrix SDWAN WAN-OP版本反映的跨站点脚本（XSS）。</p>', '<p>1.建议受影响的用户升级至官方最新版本</p><p></p><p>2.未能及时安装新版的，可限制只允许可信源IP访问</p>', 'Any', NULL);
INSERT INTO `vulnerabilities` VALUES (856, 'CouchDB 提权漏洞 (CVE-2017-12635)', 'CVE-2017-12635', '', 'high', '权限提升', '<p style=\"text-align:left;text-indent:2em;\">Apache CouchDB是一个开源数据库，专注于易用性和成为”完全拥抱web的数据库”。它是一个使用JSON作为存储格式，JavaScript作为查询语言，MapReduce和HTTP作为API的NoSQL数据库。应用广泛，如BBC用在其动态内容展示平台，Credit Suisse用在其内部的商品部门的市场框架，Meebo，用在其社交平台（web和应用程序）。</p><p style=\"text-align:left;text-indent:2em;\">在2017年11月15日，CVE-2017-12635和CVE-2017-12636披露，CouchDB被曝存在远程代码执行的问题。其中CVE-2017-12636的任意命令执行早在2016年即被披露， 但并未引起重视。</p>', '<p style=\"text-align:left;text-indent:2em;\">所有用户都应升级到CouchDB 1.7.1或 2.1.1。</p><p></p><p style=\"text-align:left;text-indent:2em;\">配置HTTP API配置参数，针对敏感配置信息加入黑名单。</p>', 'Any', NULL);
INSERT INTO `vulnerabilities` VALUES (857, 'CouchDB 未授权访问漏洞 (CVE-2017-12636)', 'CVE-2017-12636', '', 'high', '未授权', '<p>CouchDB 是一个开源的面向文档的数据库管理系统，可以通过 RESTful JavaScript Object Notation (JSON) API 访问。CouchDB会默认会在5984端口开放Restful的API接口，用于数据库的管理功能。</p><p>除了local.ini的配置文件，CouchDB允许通过自身提供的Restful API接口动态修改配置属性。通过一个未授权访问的CouchDB，通过修改其query_server配置，来执行系统命令。</p>', '<p>1.建议受影响的用户升级至官方最新版本</p><p></p><p>2.未能及时安装新版的，可限制只允许可信源IP访问</p>', 'Any', NULL);
INSERT INTO `vulnerabilities` VALUES (858, 'DedeCMS 信息泄露漏洞 (CVE-2018-6910)', 'CVE-2018-6910', 'CNNVD-201802-949', 'low', '', '<p style=\"text-align:start;text-indent:2em;\">Desdev DedeCMS（织梦内容管理系统）是中国卓卓网络（Desdev）科技有限公司的一套开源的集内容发布、编辑、管理检索等于一体的PHP网站内容管理系统（CMS）。</p><p style=\"text-align:start;text-indent:2em;\">Desdev DedeCMS 5.7版本中存在信息泄露漏洞。远程攻击者可通过对include/downmix.inc.php或inc/inc_archives_functions.php文件发送直接请求利用该漏洞获取完整路径。</p>', '<p style=\"text-align:start;text-indent:2em;\">建议使用此软件的用户随时关注厂商主页或参考网址以获取解决办法：</p><p style=\"text-align:start;text-indent:2em;\" class=\"ldgg\"><a href=\"http://www.dedecms.com/\" target=\"_Blank\">http://www.dedecms.com/</a></p>', 'PHP', NULL);
INSERT INTO `vulnerabilities` VALUES (859, 'DedeCMS V5.7 后台任意代码执行 (CVE-2018-7700)', 'CVE-2018-7700', 'CNNVD-201803-954', 'high', '命令执行', '<p><span style=\"color:#585858\"><span style=\"font-size:16px\"><span style=\"background-color:#ffffff\">DesdevDedeCMS（织梦内容管理系统）是中国卓卓网络（Desdev）科技有限公司的一套开源的集内容发布、编辑、管理检索等于一体的PHP网站内容管理系统（CMS）。DesdevDedeCMS5.7版本中存在跨站请求伪造漏洞。远程攻击者可通过向tag_test_action.php文件发送‘partcode’参数利用该漏洞执行任意代码。</span></span></span></p>', '<p>联系厂商更新版本</p>', 'PHP', NULL);
INSERT INTO `vulnerabilities` VALUES (860, '泛微 E-cology 任意文件下载', '', '', 'high', '任意文件下载', '<p><span style=\"color:#4d4d4d\"><span style=\"font-size:16px\"><span style=\"background-color:#ffffff\">泛微e-cology OA系统存在任意文件下载漏洞，攻击者可利用该漏洞下载任意文件。</span></span></span></p>', '<p>联系厂商升级相关组件。https://www.weaver.com.cn/cs/securityDownload.asp</p>', 'JAVA', NULL);
INSERT INTO `vulnerabilities` VALUES (861, 'Influxdb 未授权访问', '', '', 'high', '配置错误', '<p>InuxDB 是一个使用Go语言编写的开源分布式，支持高并发的时序数据库。</p><p>InuxDB 的 Web 操作界面默认运行在 localhost 8083 端口; HTTP API 接口默认运行在 localhost 8086 端口。</p><p>如果直接将只能本机访问到的 localhost 改为内网或者公网IP，没有配置访问控制的口令，便可能会产生未授权访问漏洞。</p>', '<p>Inuxdb的web和api均配置严格的访问控制</p>', 'Any', NULL);
INSERT INTO `vulnerabilities` VALUES (862, 'Jenkins 远程代码执行漏洞 (CVE-2018-1000861)', 'CVE-2018-1000861', 'CNNVD-201812-386', 'high', '命令执行', '<p style=\"text-align:start;text-indent:2em;\">CloudBees Jenkins（前称Hudson Labs）是美国CloudBees公司的一套基于Java开发的持续集成工具，它主要用于监控持续的软件版本发布/测试项目和一些定时执行的任务。LTS（Long-Term Support）是CloudBees Jenkins的一个长期支持版本。</p><p style=\"text-align:start;text-indent:2em;\"></p><p style=\"text-align:start;text-indent:2em;\">CloudBees Jenkins 2.153及之前版本和LTS 2.138.3及之前版本中的stapler/core/src/main/java/org/kohsuke/stapler/MetaClass.java文件的StaplerWeb框架存在代码执行漏洞。攻击者可借助特制的URLs利用该漏洞执行代码。</p>', '<p style=\"text-align:start;text-indent:2em;\"><br/>目前厂商已发布升级补丁以修复漏洞，补丁获取链接：</p><p style=\"text-align:start;text-indent:2em;\" class=\"ldgg\"><a href=\"https://jenkins.io/security/advisory/2018-12-05/#SECURITY-1193\" target=\"_Blank\">https://jenkins.io/security/advisory/2018-12-05/#SECURITY-1193</a></p>', 'Any', NULL);
INSERT INTO `vulnerabilities` VALUES (863, 'DedeCMS 会员中心 sql注入漏洞', '', '', 'high', 'SQL 注入', '<p><span style=\"color:#4d4d4d\"><span style=\"font-size:16px\"><span style=\"background-color:#ffffff\">Dedecms会员中心存在注入漏洞。</span></span></span></p>', '<p>1.建议受影响的用户升级至官方最新版本</p><p></p><p>2.未能及时安装新版的，可限制只允许可信源IP访问</p>', 'Any', NULL);
INSERT INTO `vulnerabilities` VALUES (864, 'Discuz 7.2 sql注入漏洞', '', '', 'high', 'SQL 注入', '<p><span style=\"color:#4d4d4d\"><span style=\"font-size:16px\"><span style=\"background-color:#ffffff\">Discuz7.2 faq.php 存在sql注入漏洞</span></span></span></p>', '<p>联系厂商升级版本</p>', 'Any', NULL);
INSERT INTO `vulnerabilities` VALUES (865, 'Discuz 微信插件 未授权访问', 'CVE-2018-20424', 'CNNVD-201812-1074', 'middle', '未授权', '<p>Discuz 3.4默认安装了微信登陆。如果有用户点了一下绑定微信，但是并没有绑定，会写入common_member_wechatmp，</p><p>wechat.inc.php230行附近，会取出第一个用户，然后重复使用这个tmp，但是在取出后，setloginstatus($member, 1296000);就导致可以越权进入上一个人账号。攻击者可以利用该插件的漏洞绕过论坛的邮箱、手机号等各种验证非法创建论坛账号，通过该漏洞创建的论坛账号具备一般用户的所有权限，可以任意发帖回帖。</p>', '<p style=\"text-align:start;text-indent:2em;\"></p><p>关注厂商主页或参考网址以获取解决办法：<a href=\"http://www.discuz.net/\" target=\"_Blank\">http://www.discuz.net/</a></p><p>或者在论坛后台关闭微信登录插件。</p>', 'Any', NULL);
INSERT INTO `vulnerabilities` VALUES (866, 'FineCMS 5.0.10 任意sql执行', '', '', 'high', '命令执行', '<p><span style=\"color:#585858\"><span style=\"font-size:16px\"><span style=\"background-color:#ffffff\">DayruiFineCms是中国天睿（Dayrui）程序设计团队发布的一套使用MVC架构和PDO数据库接口开发的内容管理系统（CMS）。dayruiFineCms5.0.10版本中存在任意sql执行漏洞。攻击者可利用该漏洞执行任意的SQL代码。</span></span></span></p>', '<p>联系厂商升级版本。</p>', 'Any', NULL);
INSERT INTO `vulnerabilities` VALUES (867, 'Hadoop YARN ResourceManager 未授权访问', '', '', 'high', '未授权', '<p style=\"text-align:left;text-indent:2em;\">Hadoop是一款由Apache基金会推出的分布式系统框架，它通过著名的 MapReduce 算法进行分布式处理，Yarn是Hadoop集群的资源管理系统。</p><p style=\"text-align:left;text-indent:2em;\">此次事件主要因Hadoop YARN 资源管理系统配置不当，导致可以未经授权进行访问，从而被攻击者恶意利用。攻击者无需认证即可通过REST API部署任务来执行任意指令，最终完全控制服务器。</p>', '<p style=\"text-align:left;text-indent:2em;\">1.缓解建议：</p><p></p><p style=\"text-align:left;text-indent:2em;\">如果本身Hadoop环境仅对内网提供服务，请不要将Hadoop服务端口发布到互联网</p><p></p><p style=\"text-align:left;text-indent:2em;\">2.彻底解决建议:</p><p></p><p style=\"text-align:left;text-indent:2em;\">若使用自建的Hadoop，根据实际情况及时更新补丁，Hadoop在2.X以上版本提供了安全认证功能，加入了Kerberos认证机制，建议启用Kerberos认证功能</p>', 'Any', NULL);
INSERT INTO `vulnerabilities` VALUES (868, 'jboss jmx-console 未授权访问', '', '', 'middle', '未授权', '<p>JBossweb_console验证方式：打开  /jmx-console/ 验证是否是Jboss web_console页面。</p>', '<p>1.建议受影响的用户升级至官方最新版本</p><p></p><p>2.未能及时安装新版的，可限制只允许可信源IP访问</p>', 'JAVA', NULL);
INSERT INTO `vulnerabilities` VALUES (869, 'Atlassian Jira 枚举用户漏洞 (CVE-2019-8449)', 'CVE-2019-8449', '', 'low', '信息泄漏', '<p><span style=\"color:#555555\"><span style=\"font-size:15px\"><span style=\"background-color:#ffffff\">该漏洞就是在Jira 8.4.0以前的版本，攻击者可以在不经过授权的情况下访问/rest/api/latest/groupuserpicker这个路径来枚举用户。</span></span></span></p>', '<p><span style=\"color:#333333\"><span style=\"font-size:15px\"><span style=\"letter-spacing:0.75px\"><span style=\"background-color:#ffffff\">1.JIRA升级至官方最新版本</span></span></span></span></p><p><span style=\"color:#333333\"><span style=\"font-size:15px\"><span style=\"letter-spacing:0.75px\"><span style=\"background-color:#ffffff\">2.配置安全组，限制只允许可信源IP访问</span></span></span></span></p>', 'Any', NULL);
INSERT INTO `vulnerabilities` VALUES (870, 'Joomla Component vReview sql注入', '', '', 'high', 'SQL 注入', '<p>Joomla Component vReview 1.9.11 存在SQL 注入</p>', '<p>1.建议受影响的用户升级至官方最新版本</p><p></p><p>2.未能及时安装新版的，可限制只允许可信源IP访问</p>', 'Any', NULL);
INSERT INTO `vulnerabilities` VALUES (871, 'Joomla sql注入 (CVE-2015-7297)', 'CVE-2015-7297', 'CNNVD-201510-701', 'high', 'SQL 注入', '<p><span style=\"color:#585858\"><span style=\"font-size:16px\"><span style=\"background-color:#ffffff\">Joomla!是美国OpenSourceMatters团队的一套使用PHP和MySQL开发的开源、跨平台的内容管理系统(CMS)。Joomla!3.4.4之前3.2版本中存在SQL注入漏洞。远程攻击者可利用该漏洞执行任意SQL命令。</span></span></span></p>', '<p style=\"text-align:start;text-indent:2em;\">目前厂商已经发布了升级补丁以修复此安全问题，补丁获取链接：</p><p style=\"text-align:start;text-indent:2em;\" class=\"ldgg\"><a href=\"http://developer.joomla.org/security-centre/628-20151001-core-sql-injection.html\" target=\"_Blank\">http://developer.joomla.org/security-centre/628-20151001-core-sql-injection.html</a></p>', 'PHP', NULL);
INSERT INTO `vulnerabilities` VALUES (872, 'Joomla 3.7 Core sql注入 (CVE-2017-8917)', 'CVE-2017-8917', '', 'high', 'SQL 注入', '<p>Joomla于2017年5月17日发布了新版本3.7.1,（<a href=\"https://www.joomla.org/announcements/release-news/5705-joomla-3-7-1-release.html\">https://www.joomla.org/announcements/release-news/5705-joomla-3-7-1-release.html</a>），本次更新中修复一个高危SQL注入漏洞（<a href=\"https://developer.joomla.org/security-centre/692-20170501-core-sql-injection.html\">https://developer.joomla.org/security-centre/692-20170501-core-sql-injection.html</a>），成功利用该漏洞后攻击者可以在未授权的情况下进行SQL注入。</p>', '<p>更新至安全版本</p>', 'PHP', NULL);
INSERT INTO `vulnerabilities` VALUES (873, 'Joomla PrayerCenter sql注入漏洞 (CVE-2018-7314)', 'CVE-2018-7314', 'CNNVD-201802-550', 'high', 'SQL 注入', '<p><span style=\"color:#585858\"><span style=\"font-size:16px\"><span style=\"background-color:#ffffff\">Joomla!是美国OpenSourceMatters团队开发的一套开源的内容管理系统(CMS)，该系统提供RSS馈送、网站搜索等功能。PrayerCenter是使用在其中的一个祷告分享组件。Joomla!PrayerCenter3.0.2版本中存在SQL注入漏洞。远程攻击者可借助‘sessionid’参数利用该漏洞查看、添加、更改或删除后端数据库中的信息。</span></span></span></p>', '<p>1.建议受影响的用户升级至官方最新版本</p><p></p><p>2.未能及时安装新版的，可限制只允许可信源IP访问</p>', 'PHP', NULL);
INSERT INTO `vulnerabilities` VALUES (874, 'Joomla Zh BaiduMap sql注入漏洞', 'CVE-2018-6605', 'CNNVD-201802-095', 'high', 'SQL 注入', '<p style=\"text-align:start;text-indent:2em;\">Joomla!是美国Open Source Matters团队开发的一套开源的内容管理系统(CMS)，该系统提供RSS馈送、网站搜索等功能。Zh BaiduMap是使用在其中的一个百度地图组件。</p><p style=\"text-align:start;text-indent:2em;\">Joomla! Zh BaiduMap 3.0.0.1版本中存在SQL注入漏洞。远程攻击者可借助getPlacemarkDetails、getPlacemarkHoverText、getPathHoverText或getPathDetails请求中的‘id’参数利用该漏洞注入SQL命令。</p>', '<p style=\"text-align:start;text-indent:2em;\">建议使用此软件的用户随时关注厂商主页或参考网址以获取解决办法：</p><p style=\"text-align:start;text-indent:2em;\" class=\"ldgg\"><a href=\"https://extensions.joomla.org/extensions/extension/maps-a-weather/maps-a-locations/zh-baidumap/\" target=\"_Blank\">https://extensions.joomla.org/extensions/extension/maps-a-weather/maps-a-locations/zh-baidumap/</a></p>', 'PHP', NULL);
INSERT INTO `vulnerabilities` VALUES (875, 'Jupyter Notebook 未授权访问', '', '', 'info', '未授权', '<p><span style=\"color:#64646d\"><span style=\"font-size:15px\"><span style=\"background-color:#ffffff\">如果管理员未为Jupyter Notebook配置密码，将导致未授权访问漏洞，游客可在其中创建一个console并执行任意Python代码和命令。</span></span></span></p>', '<p><span style=\"color:#64646d\"><span style=\"font-size:15px\"><span style=\"background-color:#ffffff\">就是开启身份验证，防止未经授权用户访问。</span></span></span></p>', 'Python', NULL);
INSERT INTO `vulnerabilities` VALUES (876, 'Kibana 未授权访问', '', '', 'high', '信息泄漏', '<p>Kibana拥有一个基于浏览器的管理界面，可实时从Elasticsearch中获取数据，然后执行高级数据分析，最后将结果以图表，表格和地图的形式呈现出来。如果未配置访问控制/身份验证，将导致数据泄露。</p><p>在默认设置下，Kibana会开放在端口5601上。</p>', '<p>配置访问控制/身份验证</p>', 'Any', NULL);
INSERT INTO `vulnerabilities` VALUES (877, 'Maccms 8.x 远程命令执行漏洞', '', '', 'high', '命令执行', '<p><a href=\"https://www.uedbox.com/post/tag/%e8%8b%b9%e6%9e%9ccms/\">苹果CMS</a>是国内优秀的开源PHP建站系统，擅长电影程序影视系统这一块，在主流建站系统中特色鲜明，以灵活、小巧、兼容性好、负载强等优点而深受许多站长的喜爱。<a href=\"https://www.uedbox.com/post/tag/%e8%8b%b9%e6%9e%9ccms/\">苹果CMS</a>8.x版本存在远程命令执行漏洞。</p>', '<p>1.建议受影响的用户升级至官方最新版本</p><p></p><p>2.未能及时安装新版的，可限制只允许可信源IP访问</p>', 'PHP', NULL);
INSERT INTO `vulnerabilities` VALUES (878, 'Maccms 山寨站点 V10 后门', '', '', 'high', '其他类型', '<p>MacCMS官网因为某些原因停摆。同时在百度搜索苹果CMS或MacCMS出现的排名第一均为一个：www.maccmsv10.com的网址，而真正的官网地址是www.maccms.com。前者使用了一个和maccms官网一模一样的静态首页提供程序下载。最近几天陆续有人发现了从这个网站下载的苹果CMS程序存在后门<a href=\"https://www.uedbox.com/post/tag/webshell/\">webshell</a>。</p>', '<p>删除后门文件。</p>', 'PHP', NULL);
INSERT INTO `vulnerabilities` VALUES (879, 'Metinfo sql注入 (CVE-2019-16996)', 'CVE-2019-16996', 'CNNVD-201909-1346', 'high', 'SQL 注入', '<p style=\"text-align:start;text-indent:2em;\"></p><p>MetInfo是中国米拓（MetInfo）公司的一套使用PHP和Mysql开发的内容管理系统（CMS）。Metinfo 7.0.0beta版本中存在SQL注入漏洞。该漏洞源于基于数据库的应用缺少对外部输入SQL语句的验证。攻击者可利用该漏洞执行非法SQL命令。</p>', '<p style=\"text-align:start;text-indent:2em;\"></p><p>目前厂商暂未发布修复措施解决此安全问题，建议使用此软件的用户随时关注厂商主页或参考网址以获取解决办法：<a href=\"https://www.metinfo.cn/\" target=\"_Blank\">https://www.metinfo.cn/</a></p>', 'Any', NULL);
INSERT INTO `vulnerabilities` VALUES (880, 'Metinfo 任意文件读取漏洞', '', 'cnvd-2018-13393', 'high', 'SQL 注入', '<p>MetInfo是一套使用PHP和Mysql开发的内容管理系统。 MetInfo 6.0.0~6.1.0版本中的old_thumb.class.php文件存在任意文件读取漏洞。攻击者可利用漏洞读取网站上的敏感文件。</p>', '<p style=\"text-align:start;text-indent:2em;\">建议使用此软件的用户随时关注厂商主页或参考网址以获取解决办法：</p><p style=\"text-align:start;text-indent:2em;\" class=\"ldgg\"><a href=\"https://www.metinfo.cn/\" target=\"_Blank\">https://www.metinfo.cn/</a></p>', 'PHP', NULL);
INSERT INTO `vulnerabilities` VALUES (881, 'Metinfo sql注入 (CVE-2019-17418)', 'CVE-2019-17418', '', 'high', 'SQL 注入', '<p style=\"text-align:start;text-indent:2em;\"></p><p>MetInfo是中国米拓（MetInfo）公司的一套使用PHP和Mysql开发的内容管理系统（CMS）。</p><p>Metinfo 7.0.0beta版本中存在SQL注入漏洞。该漏洞源于基于数据库的应用缺少对外部输入SQL语句的验证。攻击者可利用该漏洞执行非法SQL命令。</p>', '<p style=\"text-align:start;text-indent:2em;\"></p><p>目前厂商暂未发布修复措施解决此安全问题，建议使用此软件的用户随时关注厂商主页或参考网址以获取解决办法：<a href=\"https://www.metinfo.cn/\" target=\"_Blank\">https://www.metinfo.cn/</a></p>', 'Any', NULL);
INSERT INTO `vulnerabilities` VALUES (882, 'mongo express 远程命令执行漏洞 (CVE-2019-10758)', 'CVE-2019-10758', 'CNNVD-201912-1087', 'high', '命令执行', '<p><span style=\"color:#585858\"><span style=\"font-size:16px\"><span style=\"background-color:#ffffff\">mongo-express是一款用于交互式管理MongoDB数据库的、基于Web的轻量级管理界面。 mongo-express 0.54.0之前版本中存在安全漏洞。攻击者可借助使用toBSON方法的端点利用该漏洞执行代码。</span></span></span></p>', '<p style=\"text-align:start;text-indent:2em;\"><br/>目前厂商已发布升级补丁以修复漏洞，详情请关注厂商主页：</p><p style=\"text-align:start;text-indent:2em;\" class=\"ldgg\"><a href=\"https://github.com/mongo-express\" target=\"_Blank\">https://github.com/mongo-express</a></p>', 'Any', NULL);
INSERT INTO `vulnerabilities` VALUES (892, 'Resin 任意文件读取漏洞', 'CVE-2006-2438', 'CNNVD-200605-330', 'high', '任意文件读取', '<p>目标系统存在任意文件读取漏洞，可读取网站根目录下的任意文件。</p><p><br /></p>', '删除resin_doc相关目录与文件。', 'JAVA', NULL);
INSERT INTO `vulnerabilities` VALUES (927, 'uWSGI PHP目录穿越漏洞（CVE-2018-7490）', 'CVE-2018-7490', 'CNNVD-201802-635 ', 'high', '目录穿越', '<p style=\"box-sizing: border-box; margin-bottom: 16px; margin-top: 0px; color: rgb(36, 41, 46); >uWSGI是一款Web应用程序服务器，它实现了WSGI、uwsgi和http等协议，并支持通过插件来运行各种语言。</p><p style=\"box-sizing: border-box; margin-bottom: 16px; margin-top: 0px; color: rgb(36, 41, 46); >uWSGI 2.0.17之前的PHP插件，没有正确的处理<code style=\"box-sizing: border-box; >DOCUMENT_ROOT</code>检测，导致用户可以通过<code style=\"box-sizing: border-box; >..%2f</code>来跨越目录，读取或运行<code style=\"box-sizing: border-box; >DOCUMENT_ROOT</code>目录以外的文件</p><p><br/> </p>', '<ol class=\" list-paddingleft-2\" style=\"list-style-type: decimal;\"><li><p>升级最新版本</p></li></ol>', 'PHP', NULL);
INSERT INTO `vulnerabilities` VALUES (947, 'WebLogic 反序列化远程命令执行漏洞 (CVE-2017-10217)', 'CVE-2017-10217', 'CNNVD-201710-761', 'high', '命令执行', '<p style=\"white-space: normal; box-sizing: border-box; margin-top: 0px; margin-bottom: 8.5px; line-height: 30px; color: #616161; >&nbsp; &nbsp; &nbsp; 早期，黑客利用WebLogic WLS 组件漏洞对企业服务器发起大范围远程攻击，有大量企业的服务器被攻陷，且被攻击企业数量呈现明显上升趋势，需要引起高度重视。其中，CVE-2017-3506是一个利用Oracle WebLogic中WLS 组件的远程代码执行漏洞，属于没有公开细节的野外利用漏洞，大量企业尚未及时安装补丁。官方在 2017 年 4 月份就发布了该漏洞的补丁。 &nbsp; &nbsp; &nbsp;</p>\r\n<p style=\"white-space: normal; box-sizing: border-box; margin-top: 0px; margin-bottom: 8.5px; line-height: 30px; color: #616161; >&nbsp; &nbsp; &nbsp; 该漏洞的利用方法较为简单，攻击者只需要发送精心构造的 HTTP 请求，就可以拿到目标服务器的权限，危害巨大。由于漏洞较新，目前仍然存在很多主机尚未更新相关补丁。预计在此次突发事件之后，很可能出现攻击事件数量激增，大量新主机被攻陷的情况。</p>\r\n<p style=\"white-space: normal; box-sizing: border-box; margin-top: 0px; margin-bottom: 8.5px; line-height: 30px; color: #616161; >&nbsp; &nbsp; &nbsp; Oracle官方四月份补丁对CVE-2017-3506该漏洞修复不彻底，可以绕过补丁，依旧执行远程命令。CVE-2017-10352目前绕过的漏洞在官方发布的十月份的补丁中已修复。</p>\r\n<p style=\"white-space: normal; box-sizing: border-box; margin-top: 0px; margin-bottom: 8.5px; line-height: 30px; color: #616161; ><strong>目前互联网上CVE-2017-10352被大量误传为CVE-2017-10271</strong></p>\r\n<p>&nbsp;</p>', '<blockquote style=\"box-sizing: border-box; padding: 10px 20px; margin: 0px 0px 20px;  border-left: 5px solid #eeeeee; background: #f7f7f7; color: #585858; >\r\n<p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 10px;  line-height: 26px; overflow-wrap: break-word; word-break: break-word;\">1.&nbsp;&nbsp; &nbsp;升级Oracle 2017年10月份CPU补丁</p>\r\n<p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 0px;  line-height: 26px; overflow-wrap: break-word; word-break: break-word;\">2.&nbsp;&nbsp; &nbsp;对访问wls-wsat\\_async的资源进行访问控制或直接删除</p>\r\n</blockquote>\r\n<p>&nbsp;</p>', 'JAVA', NULL);
INSERT INTO `vulnerabilities` VALUES (951, 'Tomcat 存在弱口令', '', '', 'high', '弱口令', '<p>Apache Tomcat <span style=\">服务器是一个免费的开放源代码的</span><span style=\">Web </span><span style=\">应用服务器。</span></p>\r\n<p><span style=\">目标</span><span style=\">Apache Tomcat</span><span style=\">系统配置存在弱口令</span></p>\r\n<p>验证方式：去目标页面验证是否存在报告所述弱口令</p>\r\n<p>示例：<img src=\"http://p1.qhimg.com/t01f2aa2c74f08af3d2.png\" alt=\"\" /></p>\r\n<p>&nbsp;</p>', '<p>1.<span style=\">修改</span><span style=\">Apache Tomcat </span><span style=\">服务器的弱口令为强口令</span></p>\r\n<p>2.<span style=\">设置</span><span style=\">Apache Tomcat</span><span style=\">的</span><span style=\">Manager</span><span style=\">页面只可以通过内网访问</span></p>\r\n<p>Windows:windows+r<span style=\">调用运行</span><span style=\">&gt;</span><span style=\">输入</span><span style=\">secpol.msc</span><span style=\">打开安全策略</span><span style=\">&gt;</span><span style=\">配置</span><span style=\">ip</span><span style=\">安全策略</span><span style=\">&gt;</span><span style=\">设置</span><span style=\">8080</span><span style=\">端口禁止外网访问</span></p>\r\n<p>&nbsp;</p>\r\n<p>Linux:<span style=\">配置</span><span style=\">iptables -A INPUT </span><span style=\">&ndash;</span><span style=\">p tcp --dport 8080 -i </span><span style=\">外网网卡名 </span><span style=\">-j drop,</span><span style=\">关闭</span><span style=\">8080</span><span style=\">端口对外开放</span></p>\r\n<p>3.<span style=\">删除默认的</span><span style=\">Manager</span><span style=\">页面，修改</span><span style=\">server.xml</span><span style=\">中</span><span style=\">HOST</span><span style=\">容器的配置，将</span><span style=\">appBase</span><span style=\">的值修改成</span><span style=\">Tomcat</span><span style=\">应用所在的目录，比如</span><span style=\">appBase=/usr/local/apache/htdocs</span></p>', 'JAVA', NULL);
INSERT INTO `vulnerabilities` VALUES (953, 'Shell Shock 漏洞', 'CVE-2014-7169', 'CNNVD-201409-956', 'middle', '其他类型', '<p>Bash代码注入漏洞可以允许任意代码(CVE-2014-7169)，允许远程攻击者未经身份验证的利用此漏洞通过提供环境变量。</p>', '<p>升级至新版本</p><p>针对RedHat、CentOS Liunx发行版本，请执行：yum -y update bash</p><p>针对Debian Liunx发行版本，请执行：sudo apt-get update &amp;&amp; sudo apt-get install --only-upgrade bash</p>', 'Any', NULL);
INSERT INTO `vulnerabilities` VALUES (981, 'Coremail邮件系统mailsms接口信息泄露', '', '', 'middle', '信息泄漏', '<p>Coremail是国内使用广泛的优秀电子邮箱系统，其部分版本存在mailsms接口信息泄露风险。</p>', '<p>1.&nbsp; 对mailsms接口设置ACL</p>\r\n<p>2. 联系厂商升级Coremail到最新版本</p>\r\n<p>3. 安装防护类软件</p>', 'JAVA', NULL);
INSERT INTO `vulnerabilities` VALUES (984, 'FineReport8管理员密码可获取', '', '', 'high', '信息泄漏', '<p>FineReport报表软件是一款纯Java编写的、集数据展示(报表)和数据录入(表单)功能于一身的企业级web报表工具，在国内广泛使用。</p>\r\n<p>其某无授权接口可读取到管理员账号密码文件，虽然密码经过加密，但是可在源码中获取加解密方法。</p>', '<p>联系厂商升级、配置ACL。</p>', 'JAVA', NULL);
INSERT INTO `vulnerabilities` VALUES (988, 'Zimbra Autodiscover XML实体注入漏洞', 'CVE-2019-9670', 'CNNVD-201904-600', 'high', '任意文件读取', '<p>Zimbra邮件系统存在XXE漏洞，可造成任意文件读取。</p>', '<p>1. 升级到最新版。</p>\r\n<p>2. 如非必要，关闭AutoDiscover功能。</p>', 'JAVA', NULL);
INSERT INTO `vulnerabilities` VALUES (993, 'PHP CGI任意代码执行漏洞', '', '', 'high', '代码执行', '<p>目标存在任意代码执行漏洞<br />通过使用cgi的方式来支持php脚本运行时，由于某些特殊字符的处理不当，导致恶意攻击者可以执行任意执行。</p>', '<p>升级至官方最新版本：<br />http://www.php.net/<br /><br />或者下载临时php补丁：<br /><a href=\"http://eindbazen.net/wp-content/uploads/2012/05/CVE-2012-1823-mitigation.tar.gz\">http://eindbazen.net/wp-content/uploads/2012/05/CVE-2012-1823-mitigation.tar.gz</a></p>', 'PHP', NULL);
INSERT INTO `vulnerabilities` VALUES (994, 'WebLogic 反序列化远程命令执行漏洞 (CVE-2019-2725)', 'CVE-2019-2725', 'CNNVD-201904-1251', 'high', '命令执行', '<p>Oracle Fusion Middleware（Oracle融合中间件）是美国甲骨文（Oracle）公司的一套面向企业和云环境的业务创新平台。该平台提供了中间件、软件集合等功能。</p>\r\n<p>WebLogic Server是其中的一个适用于云环境和传统环境的应用服务器组件。</p>\r\n<p>Weblogic的某Webservice组件存在命令执行漏洞。可进行任意命令执行。</p>', '<p><span style=\">1. 升级Oracle最新CPU补丁</span></p>\r\n<p><span style=\">2. 对wls-wsat目录设置权限</span></p>\r\n<p><span style=\">3.删除wls-wsat目录对应war文件</span></p>', 'JAVA', NULL);
INSERT INTO `vulnerabilities` VALUES (996, 'WebLogic 反序列化远程命令执行漏洞 (CVE-2019-2729)', 'CVE-2019-2729', 'CNNVD-201906-733', 'high', '命令执行', '<p>Oracle Fusion Middleware（Oracle融合中间件）是美国甲骨文（Oracle）公司的一套面向企业和云环境的业务创新平台。该平台提供了中间件、软件集合等功能。</p>\r\n<p>WebLogic Server是其中的一个适用于云环境和传统环境的应用服务器组件。</p>\r\n<p>Weblogic的某Webservice组件存在命令执行漏洞。可进行任意命令执行。</p>\r\n<p>CVE-2019-2729为CVE-2019-2725的绕过。</p>', '<p><span style=\">1. 升级Oracle最新CPU补丁</span></p>\r\n<p><span style=\">2. 对_async目录设置权限</span></p>\r\n<p><span style=\">3.删除_async目录对应war文件</span></p>\r\n<p>&nbsp;</p>', 'JAVA', NULL);
INSERT INTO `vulnerabilities` VALUES (1001, 'Confluence CVE-2019-3396漏洞（命令执行）', 'CVE-2019-3396', 'CNNVD-201903-909', 'high', '命令执行', '<p>Atlassian Confluence Server是澳大利亚Atlassian公司的一套专业的企业知识管理与协同软件，也可以用于构建企业WiKi。</p>\r\n<p>Atlassian Confluence Server中存在安全漏洞。远程攻击者可借助Widget Connector宏利用该漏洞执行代码。</p>\r\n<p>该告警为利用该漏洞进行远程模板包含，并进行命令执行的用法。</p>', '<p>1. 升级Confluence到最新版</p>\r\n<p>2. 关闭widget组件</p>', 'JAVA', NULL);
INSERT INTO `vulnerabilities` VALUES (1010, 'POST XML实体注入漏洞', '', '', 'middle', 'XML 注入', '<p>XXE Injection即XML External Entity Injection,也就是XML外部实体注入攻击.漏洞是在对非安全的外部实体数据进⾏行处理时引发的安全问题。</p><p>我们会对目标服务器发起该漏洞的请求。如果被检测的目标服务器存在这个漏洞，就会对 eye.webscan.360.cn <span style=\"color:#000000\"><strong>发起一个带有此次请求唯一且正常请求中不会包含的标识</strong></span>的请求。当我们<span style=\"color:#000000\"><strong>在 e.yzt.360.cn 接收到的请求中包含这个特定的标识时，即可认为被检测的目标服务器存在这个漏洞。</strong></span></p><p> </p>', '<p margin:=\"\" 0px;=\"\" padding:=\"\" 0px;\"=\"\">方案一、使用开发语言提供的禁用外部实体的方法</p><p margin:=\"\" 0px;=\"\" padding:=\"\" color:=\"\" #333333;=\"\"> </p><p>libxml_disable_entity_loader(true);</p><p margin:=\"\" 0px;=\"\" padding:=\"\" color:=\"\" #333333;=\"\"> </p><p>DocumentBuilderFactory dbf =DocumentBuilderFactory.newInstance();</p><p>dbf.setExpandEntityReferences(false);</p><p margin:=\"\" 0px;=\"\" padding:=\"\" 0px;\"=\"\">Python：</p><p>from lxml import etree<br/> xmlData = etree.parse(xmlSource,etree.XMLParser(resolve_entities=False))<br/> </p><p margin:=\"\" 10px=\"\" auto;=\"\" padding:=\"\" 0px;=\"\" color:=\"\" #333333;=\"\">方案二、过滤用户提交的XML数据 </p><p __mcedel\"=\"\">关键词：</p>', 'Any', NULL);
INSERT INTO `vulnerabilities` VALUES (1014, 'JIRA模板注入漏洞 CVE-2019-11581远程模板', 'CVE-2019-11581', 'CNNVD-201907-701', 'high', '代码执行', '<p>最近，JIRA<a href=\"https://confluence.atlassian.com/jira/jira-security-advisory-2019-07-10-973486595.html\" target=\"_blank\" rel=\"noopener\">发布</a>了一个安全公告，修复了服务器端模板注入漏洞（CVE-2019-11581），影响了Jira Server和Jira Data Center。 成功利用此漏洞的攻击者可以远程执行受影响服务器上的代码。&nbsp;</p>\r\n<p>该漏洞源自Jira Server和Data Center中的ContactAdministrator和SendBulkMail操作。 成功利用此漏洞至少需要满足以下条件之一：</p>\r\n<ul>\r\n<li>SMTP服务器在JIRA中配置，并且启用了&ldquo;联系人管理员表单&rdquo;选项。</li>\r\n<li>SMTP服务器在JIRA中配置，攻击者可以访问&ldquo;JIRA管理员&rdquo;。</li>\r\n</ul>', '<p>联系厂家升级Jira系统到最新版</p>\r\n<p><strong>临时解决方案：</strong></p>\r\n<p>关闭联系人管理员表单项目</p>\r\n<p>&nbsp;</p>', 'Any', NULL);
INSERT INTO `vulnerabilities` VALUES (1022, 'Solr CVE-2019-0193 DataImportHandler远程命令执行漏洞', 'CVE-2019-0193', 'CNNVD-201908-031', 'high', '命令执行', '<p>Apache Solr是美国阿帕奇（Apache）软件基金会的一款基于Lucene（一款全文搜索引擎）的搜索服务器。其最新漏洞CVE-2019-0193影响8.2.0以下开启DataImport功能的Solr系统，可造成命令执行。</p>', '<p>1. 升级到Solr的最新版本<a href=\"https://issues.apache.org/jira/browse/SOLR-13669\">https://issues.apache.org/jira/browse/SOLR-13669</a></p>\r\n<p>2. 临时解决方案：关闭DataImport功能</p>', 'JAVA', NULL);
INSERT INTO `vulnerabilities` VALUES (1024, 'Resin任意文件读取漏洞', 'CVE-2002-1987', 'CNNVD-200212-182', 'high', '任意文件读取', '<p>Resin存在resin-doc目录，低版本的resin-doc viewfile servlet没有进行目录限制，导致可以读取任意文件，导致重要文件泄露。</p>', '<p>1.升级resin</p>', 'JAVA', NULL);
INSERT INTO `vulnerabilities` VALUES (1026, '泛微E-cology OA BeanShell远程命令执行漏洞', '', 'CNNVD-201909-1041', 'high', 'SQL 注入', '<p>泛微E-cologyOA系统中存在BeanShell组件的Servlet，可未授权访问。攻击者可利用该漏洞在目标系统远程执行恶意代码。</p>', '<p>官网下载:</p>\r\n<p><a href=\"https://www.weaver.com.cn/cs/securityDownload.asp\">https://www.weaver.com.cn/cs/securityDownload.asp</a></p>', 'JAVA', NULL);
INSERT INTO `vulnerabilities` VALUES (1028, 'WEBMIN远程命令执行漏洞', 'CVE-2019-15107', 'CNNVD-201908-1151', 'high', '命令执行', '<p>Webmin是一个用于管理类Unix系统的管理配置工具，具有Web页面。在其找回密码页面中，存在一处无需权限的命令注入漏洞，通过这个漏洞攻击者即可以执行任意系统命令。</p>', '<p>升级Webmin到最新版本</p>', 'Any', NULL);
INSERT INTO `vulnerabilities` VALUES (1031, 'ThinkPHP 5.0* 远程命令执行', NULL, NULL, 'high', '命令执行', '在ThinkPHP 5.0.x – ThinkPHP 5.2.x版本下，由于针对method函数控制松 散，导致可以通过变量覆盖实现对任意函数进行调用，并$_POST将作为函数 的参数传入。<br>\r\n通过覆盖 filter 属性，达到远程任意命令执行，值得注意的是在 RuleGroup 的数组键值定义中不包含 filter，会导致一个报错。<br>\r\n<img src=\"http://p4.qhimg.com/t01c2596e59f84c55f8.jpg\" /><br>\r\n该漏洞需要在相关文件使用 error_reporting(0); 关闭错误来达到触发条件<br>\r\n<img src=\"http://p4.qhimg.com/t01d1c92056f92333f4.jpg\" /><br>', '经过测试 ThinkPHP 5.0.24 版本不在该漏洞影响范围内<br>\r\n建议用户升级到ThinkPHP 5.0.24版本', 'PHP', NULL);
INSERT INTO `vulnerabilities` VALUES (1032, 'PHPStudy后门发现', '', '', 'high', '命令执行', '<p>Phpstudy 2016和Phpstudy 2018中的php-5.2.17下的php_xmlrpc.dll、php-5.4.45下的php_xmlrpc.dll文件中包含恶意代码，导致黑客可通过对任意php后缀文件的访问执行任意PHP代码，默认情况下disable_funcitons为空，危害极大。属于供应链攻击</p>', '<p>1. PHP.ini中关闭php_xmlrpc.dll插件</p>\r\n<p>2. 到官网上升级到最新的PHPStudy</p>', 'PHP', NULL);
INSERT INTO `vulnerabilities` VALUES (1034, 'Ruby On Rails 路径穿越漏洞', 'CVE-2018-3760', 'CNNVD-201806-1218', 'high', '目录穿越', '<p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 16px; color: #24292e; >Ruby On Rails在开发环境下使用Sprockets作为静态文件服务器，Ruby On Rails是著名Ruby Web开发框架，Sprockets是编译及分发静态资源文件的Ruby库。</p>\r\n<p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 16px; color: #24292e; >Sprockets 3.7.1及之前版本中，存在一处因为二次解码导致的路径穿越漏洞，攻击者可以利用<code style=\"box-sizing: border-box; >%252e%252e/</code>来跨越到根目录，读取或执行目标服务器上任意文件。</p>', '<p>1. 升级rails到最新版本</p>\r\n<p>2. 安装WAF类产品</p>', 'Ruby', NULL);
INSERT INTO `vulnerabilities` VALUES (1036, 'Weblogic SSRF (CVE-2014-4210)', 'CVE-2014-4210', 'CNNVD-201407-406', 'high', '服务器端请求伪造', '<p>Oracle WebLogic Server是美国甲骨文（Oracle）公司的一款适用于云环境和传统环境的应用服务器，它提供了一个现代轻型开发平台，支持应用从开发到生产的整个生命周期管理，并简化了应用的部署和管理。</p>\r\n<p>Oracle Fusion Middleware 10.0.2.0和10.3.6.0版本的Oracle WebLogic Server组件中的WLS - Web Services子组件存在安全漏洞。远程攻击者可利用该漏洞读取数据，影响数据的保密性。</p>', '<p>删除uddiexplorer目录</p>', 'JAVA', NULL);
INSERT INTO `vulnerabilities` VALUES (1041, 'Docker API 未授权访问命令执行', '', '', 'high', '未授权', '<p>目标主机开放了docker swarm的2375端口，且未设置授权，可通过该API启动任意Docker。</p>', '<p>1. 将端口仅开放到内网</p>\r\n<p>2. 设置端口ACL</p>', 'NodeJS', NULL);
INSERT INTO `vulnerabilities` VALUES (1042, 'Typecho install.php反序列化漏洞', '', '', 'high', '反序列化', '<p></p><p style=\"box-sizing: border-box; margin: 10px 0px; padding: 0px; border: 0px; outline: 0px; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: 24px; color: rgb(51, 51, 51);>Typecho install.php存在反序列化漏洞，可执行任意代码。<br /></p>', '<p>1.升级到最新版typecho</p><p>2.删除install.php</p><p>3.注释掉序列化相关代码</p><p></p><p><span helvetica=\"\" neue=\"\" arial=\"\" sans-serif=\"\" style=\"color:#333333;\"></span></p>', 'PHP', NULL);
INSERT INTO `vulnerabilities` VALUES (1043, 'Docker Registry 未授权访问', '', '', 'high', '未授权', '<p>Docker Registry未设置授权，可以任意Pull Docker Registry中的镜像，导致镜像泄露。</p>', '<p>为Docker Registry 设置授权。</p>', 'NodeJS', NULL);
INSERT INTO `vulnerabilities` VALUES (1069, 'Kong Admin Rest API未授权访问漏洞', 'CVE-2020-11710', '', 'high', '未授权', '<p margin:=\"\" 0px;=\"\" padding:=\"\" box-sizing:=\"\" border-box;=\"\" list-style:=\"\" none;=\"\" ;=\"\" color:=\"\" #333333;=\"\" line-height:=\"\" 0.896rem;=\"\"> </p>', '<p margin:=\"\" 0px;=\"\" padding:=\"\" box-sizing:=\"\" border-box;=\"\" list-style:=\"\" none;=\"\" ;=\"\" color:=\"\" #333333;=\"\" line-height:=\"\" 0.896rem;=\"\">https://github.com/Kong/docker-kong/commit/dfa095cadf7e8309155be51982d8720daf32e31c</p><p margin:=\"\" 0px;=\"\" padding:=\"\" box-sizing:=\"\" border-box;=\"\" list-style:=\"\" none;=\"\" ;=\"\" color:=\"\" #333333;=\"\" line-height:=\"\" 0.896rem;=\"\">1.将Kong Admin API默认监听端口（默认8001和8444）设为禁止对公网开放，或仅对可信对象开放；</p>', 'Any', NULL);
INSERT INTO `vulnerabilities` VALUES (1072, 'ThinkCMF 模板缓存 Getshell漏洞', '', '', 'high', '命令执行', '<p><span style=\"color: #333333; >由于thinkcmf2.x使用了thinkphp3.x作为开发框架，默认情况下启用了报错日志并且开启了模板缓存，导致可以使用加载一个不存在的模板来将</span><span style=\"background-color: #ffffff; color: #333333; >webshell代码</span><span style=\"background-color: #ffffff; color: #333333; >写入data/runtime/Logs/Portal目录下的日志文件中，再次包含该日志文件即可在网站根目录下生成webshell。</span></p>', '<p>升级<span style=\"background-color: #ffffff; color: #333333; >ThinkCMF版本。</span></p>\r\n<p>临时方案：<span style=\"color: #333333; >将 HomebaseController.class.php 和 AdminbaseController.class.php 类中 display 和 fetch 函数的修饰符改为 protected</span></p>', 'PHP', NULL);
INSERT INTO `vulnerabilities` VALUES (1079, 'F5 BIG-IP 远程代码执行漏洞', 'CVE-2020-5902', '', 'high', '代码执行', '<p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem; color: #585858; >F5 BIG-IP&nbsp;是美国F5公司一款集成流量管理、DNS、出入站规则、web应用防火墙、web网关、负载均衡等功能的应用交付平台。在&nbsp;F5 BIG-IP&nbsp;产品的流量管理用户页面 (TMUI)/配置实用程序的特定页面中存在一处远程代码执行漏洞。</p>', '<h3 id=\"h3-5\" style=\"box-sizing: border-box; margin-top: 12px; margin-bottom: 0.5rem; >通用修补建议：</h3>\r\n<p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem; color: #585858; >升级到以下版本</p>\r\n<ul style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem; color: #585858; >\r\n<li style=\"box-sizing: border-box; list-style-type: none;\">BIG-IP 15.x: 15.1.0.4</li>\r\n<li style=\"box-sizing: border-box; list-style-type: none;\">BIG-IP 14.x: 14.1.2.6</li>\r\n<li style=\"box-sizing: border-box; list-style-type: none;\">BIG-IP 13.x: 13.1.3.4</li>\r\n<li style=\"box-sizing: border-box; list-style-type: none;\">BIG-IP 12.x: 12.1.5.2</li>\r\n<li style=\"box-sizing: border-box; list-style-type: none;\">BIG-IP 11.x: 11.6.5.2</li>\r\n</ul>\r\n<h3 id=\"h3-6\" style=\"box-sizing: border-box; margin-top: 12px; margin-bottom: 0.5rem; >临时修补建议：</h3>\r\n<p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem; color: #585858; >官方建议可以通过以下步骤临时缓解影响</p>\r\n<p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem; color: #585858; >1) 使用以下命令登录对应系统</p>\r\n<pre class=\"pure-highlightjs\" style=\"box-sizing: border-box; ><code class=\"hljs\" style=\"box-sizing: border-box; >tmsh</code></pre>\r\n<p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem; color: #585858; >2) 编辑&nbsp;httpd&nbsp;组件的配置文件</p>\r\n<pre class=\"pure-highlightjs\" style=\"box-sizing: border-box; ><code class=\"hljs apache\" style=\"box-sizing: border-box; ><span class=\"hljs-attribute\" style=\"box-sizing: border-box; color: #000080;\">edit</span> /sys httpd <span class=\"hljs-literal\" style=\"box-sizing: border-box; color: #008080;\">all</span>-properties</code></pre>\r\n<p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem; color: #585858; >3) 文件内容如下</p>\r\n<pre class=\"pure-highlightjs\" style=\"box-sizing: border-box; ><code class=\"hljs makefile\" style=\"box-sizing: border-box; ><span class=\"hljs-keyword\" style=\"box-sizing: border-box; font-weight: bold;\">include</span> \' &lt;LocationMatch <span class=\"hljs-string\" style=\"box-sizing: border-box; color: #dd1144;\">\".*\\.\\.;.*\"</span>&gt; Redirect 404 / &lt;/LocationMatch&gt; \'</code></pre>\r\n<p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem; color: #585858; >4) 按照如下操作保存文件</p>\r\n<pre class=\"pure-highlightjs\" style=\"box-sizing: border-box; ><code class=\"hljs css\" style=\"box-sizing: border-box; >按下 <span class=\"hljs-selector-tag\" style=\"box-sizing: border-box; font-weight: bold;\">ESC</span> 并依次输入 <span class=\"hljs-selector-pseudo\" style=\"box-sizing: border-box;\">:wq</span></code></pre>\r\n<p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem; color: #585858; >5) 执行命令刷新配置文件</p>\r\n<pre class=\"pure-highlightjs\" style=\"box-sizing: border-box; ><code class=\"hljs nginx\" style=\"box-sizing: border-box; ><span class=\"hljs-attribute\" style=\"box-sizing: border-box; color: #000080;\">save</span> /sys config</code></pre>\r\n<p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem; color: #585858; >6) 重启 httpd 服务</p>\r\n<pre class=\"pure-highlightjs\" style=\"box-sizing: border-box; ><code class=\"hljs nginx\" style=\"box-sizing: border-box; ><span class=\"hljs-attribute\" style=\"box-sizing: border-box; color: #000080;\">restart</span> sys service httpd</code></pre>\r\n<p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem; color: #585858; >并禁止外部IP对 TMUI 页面的访问</p>', 'JAVA', NULL);
INSERT INTO `vulnerabilities` VALUES (1086, 'Cisco ASA/FTD远程任意文件读取（CVE-2020-3452）', 'CVE-2020-3452', '', 'middle', '任意文件读取', '<p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem; color: #585858; >Cisco Adaptive Security Appliance (ASA)&nbsp;是为Cisco ASA系列提供支持的核心操作系统，它以多种形式为ASA设备提供企业级防火墙功能。Cisco Firepower Threat Defense (FTD)&nbsp;是&nbsp;Cisco&nbsp;的防火墙产品。</p>\r\n<p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem; color: #585858; >Cisco Adaptive Security Appliance (ASA) 和 Cisco Firepower Threat Defense (FTD) 的 web 服务接口存在漏洞，允许未经身份验证的远程攻击者向受影响的设备发送一个精心制作的HTTP请求，成功利用该漏洞的攻击者能够进行目录遍历攻击并读取目标系统上的敏感文件。</p>\r\n<p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem; color: #585858; >该漏洞目前仅影响启用了AnyConnect或WebVPN配置的设备，并且此漏洞不能用于访问ASA或FTD系统文件或底层操作系统(OS)文件。</p>', '<h3 id=\"h3-5\" style=\"box-sizing: border-box; margin-top: 12px; margin-bottom: 0.5rem; >通用修补建议：</h3>\r\n<p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem; color: #585858; >Cisco ASA：</p>\r\n<ul style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem; color: #585858; >\r\n<li style=\"box-sizing: border-box; list-style-type: none;\">9.6 版本以前升级到某一修复版本</li>\r\n<li style=\"box-sizing: border-box; list-style-type: none;\">9.6 版本升级到 9.6.4.42 版本</li>\r\n<li style=\"box-sizing: border-box; list-style-type: none;\">9.7 版本升级到某一修复版本</li>\r\n<li style=\"box-sizing: border-box; list-style-type: none;\">9.8 版本升级到 9.8.4.20 版本</li>\r\n<li style=\"box-sizing: border-box; list-style-type: none;\">9.9 版本升级到 9.9.2.74 版本</li>\r\n<li style=\"box-sizing: border-box; list-style-type: none;\">9.10 版本升级到 9.10.1.42 版本</li>\r\n<li style=\"box-sizing: border-box; list-style-type: none;\">9.12 版本升级到 9.12.3.12 版本</li>\r\n<li style=\"box-sizing: border-box; list-style-type: none;\">9.13 版本升级到 9.13.1.10 版本</li>\r\n<li style=\"box-sizing: border-box; list-style-type: none;\">9.14 版本升级到 9.14.1.10 版本</li>\r\n</ul>\r\n<p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem; color: #585858; >Cisco FTD：</p>\r\n<ul style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem; color: #585858; >\r\n<li style=\"box-sizing: border-box; list-style-type: none;\">6.2.2 版本升级到某一修复版本</li>\r\n<li style=\"box-sizing: border-box; list-style-type: none;\">6.2.3 版本升级到 6.2.3.16 版本</li>\r\n<li style=\"box-sizing: border-box; list-style-type: none;\">6.3.0 版本升级到 6.3.0.5(Hot Fix)/6.3.0.6/6.4.0.9(Hot Fix)/6.6.0.1 版本</li>\r\n<li style=\"box-sizing: border-box; list-style-type: none;\">6.4.0 版本升级到 6.4.0.9(Hot Fix)/6.4.0.10 版本</li>\r\n<li style=\"box-sizing: border-box; list-style-type: none;\">6.5.0 版本升级到 6.5.0.4(Hot Fix)/6.5.0.5/6.6.0.1 版本</li>\r\n<li style=\"box-sizing: border-box; list-style-type: none;\">6.6.0 版本升级到 6.6.0.1 版本</li>\r\n</ul>\r\n<p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem; color: #585858; >Cisco FTD Hot Fix 细节:</p>\r\n<ul style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem; color: #585858; >\r\n<li style=\"box-sizing: border-box; list-style-type: none;\">6.3.0.5：\r\n<pre style=\"box-sizing: border-box; >Cisco_FTD_Hotfix_AV-6.3.0.6-3.sh.REL.tar\r\nCisco_FTD_SSP_Hotfix_AV-6.3.0.6-3.sh.REL.tar\r\nCisco_FTD_SSP_FP2K_Hotfix_AV-6.3.0.6-3.sh.REL.tar\r\n</pre>\r\n</li>\r\n<li style=\"box-sizing: border-box; list-style-type: none;\">6.4.0.9：\r\n<pre style=\"box-sizing: border-box; >Cisco_FTD_Hotfix_BM-6.4.0.10-2.sh.REL.tar\r\nCisco_FTD_SSP_FP1K_Hotfix_BM-6.4.0.10-2.sh.REL.tar\r\nCisco_FTD_SSP_FP2K_Hotfix_BM-6.4.0.10-2.sh.REL.tar\r\nCisco_FTD_SSP_Hotfix_BM-6.4.0.10-2.sh.REL.tar\r\n</pre>\r\n</li>\r\n<li style=\"box-sizing: border-box; list-style-type: none;\">6.5.0.4：\r\n<pre style=\"box-sizing: border-box; >Cisco_FTD_Hotfix_O-6.5.0.5-3.sh.REL.tar\r\nCisco_FTD_SSP_FP2K_Hotfix_O-6.5.0.5-3.sh.REL.tar\r\nCisco_FTD_SSP_FP1K_Hotfix_O-6.5.0.5-3.sh.REL.tar\r\nCisco_FTD_SSP_Hotfix_O-6.5.0.5-3.sh.REL.tar\r\n</pre>\r\n</li>\r\n</ul>\r\n<p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem; color: #585858; >要升级到Cisco FTD的修复版本，客户可以执行以下操作之一:</p>\r\n<ol style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem; color: #585858; >\r\n<li style=\"box-sizing: border-box;\">对于使用Cisco Firepower Management Center（FMC）的设备，请使用FMC界面安装升级。安装完成后，重新应用访问控制策略。</li>\r\n<li style=\"box-sizing: border-box;\">对于使用Cisco Firepower Device Manager (FDM)的设备，请使用FDM界面来安装升级。安装完成后，重新应用访问控制策略。</li>\r\n</ol>\r\n<p>具体请参考：<a href=\"https://tools.cisco.com/security/center/resources/security_vulnerability_policy.html#fixes\">https://tools.cisco.com/security/center/resources/security_vulnerability_policy.html#fixes</a></p>', 'Any', NULL);
INSERT INTO `vulnerabilities` VALUES (1089, 'svn文件 信息泄露漏洞', '', '', 'high', '信息泄漏', '<p>目标存在SVN版本控制信息文件。</p><p>1.泄漏网站的一些敏感信息。</p>', '<p>设置SVN密码，并将匿名访问用户的权限设置为none。<br />发布代码时使用svn export导出，而不要使用svn co检索，防止泄露目录结构。<br />svn export使用示例<br />svn &nbsp;export &nbsp;[-r 版本号] &nbsp;http://路径 [本地目录全路径]　--username　用户名<br />svn &nbsp;export &nbsp;[-r 版本号] &nbsp;svn://路径 [本地目录全路径]　--username　用户名<br />svn &nbsp;export &nbsp;本地检出的(即带有.svn文件夹的)目录全路径 &nbsp;要导出的本地目录全路径<br />如果已经线上的生产环境已经有了.svn目录不想删掉可以在服务器上设置禁制访问此目录：<br /><br />Apache，设置.htacess:<br />&lt;Directory ~ &quot;.svn&quot;&gt;<br />Order allow,deny<br />Deny from all<br />&lt;/Directory&gt;<br />Nginx,设置配置文件:<br />location ~ ^(.*)/.svn/ {<br />return 404;<br />}：</p>', 'Any', NULL);
INSERT INTO `vulnerabilities` VALUES (1090, 'GlassFish任意文件读取', '', '', 'middle', '任意文件读取', '<p style=\"box-sizing: border-box; outline: 0px; padding: 0px; margin: 0px 0px 16px; >java语义中会把\"%c0%ae\"解析为\"\\uC0AE\"，最后转义为ASCCII字符的\".\"（点），导致形成../的形式，可进行目录穿越，任意文件下载。</p>', '<p>1.联系厂商升级</p><p>2 临时修复过滤unicode解码之后的字符串防止出现”.”,”/”等就可以了,不管是程序代码还是waf规则,都是这样做。其实还是云服务提供商的waf没有过滤严谨,因为waf完全有能力去解码url,然后配置waf规则做过滤</p>', 'JAVA', NULL);
INSERT INTO `vulnerabilities` VALUES (1092, 'Elasticsearch未授权访问', '', '', 'high', '未授权', '<p></p><p><span style=\">目标存在</span>ElasticSearch<span style=\">未授权访问漏洞。</span><span style=\">ElasticSearch</span><span style=\">是一个基于</span><span style=\">Lucene</span><span style=\">的搜索服务器。它提供了一个分布式多用户能力的全文搜索引擎，基于</span><span style=\">RESTful web</span><span style=\">接口。</span><span style=\">Elasticsearch</span><span style=\">是用</span><span style=\">Java</span><span style=\">开发的，并作为</span><span style=\">Apache</span><span style=\">许可条款下的开放源码发布，是当前流行的企业级搜索引擎。</span><span style=\">Elasticsearch</span><span style=\">未授权访问可导致</span><span style=\">ES</span><span style=\">中存储的数据被任意查看。</span></p><p></p>', '\"<p><span style=\"\"\">在</span>config/elasticsearch.yml<span style=\"\"\">中为</span><span style=\"\"\">9200</span><span style=\"\"\">端口设置认证：</span></p><p>http.basic.enabled &nbsp;&nbsp; &nbsp;true &nbsp;&nbsp;&nbsp; #<span style=\"\"\">开关，开启会接管全部</span><span style=\"\"\">HTTP</span><span style=\"\"\">连接</span><br />http.basic.user &nbsp;&nbsp; &nbsp;&quot;admin&quot; &nbsp;&nbsp;&nbsp; #<span style=\"\"\">账号</span><br />http.basic.password &nbsp;&nbsp; &nbsp;&quot;admin_pw&quot; &nbsp;&nbsp;&nbsp; #<span style=\"\"\">密码</span><br />http.basic.ipwhitelist &nbsp;&nbsp; &nbsp;[&quot;localhost&quot;, &quot;127.0.0.1&quot;] &nbsp;&nbsp;&nbsp; #<span style=\"\"\">白名单内的</span><span style=\"\"\">ip</span><span style=\"\"\">访问不需要通过账号和密码，支持</span><span style=\"\"\">ip</span><span style=\"\"\">和主机名，不支持</span><span style=\"\"\">ip</span><span style=\"\"\">区间或正则</span><br />http.basic.trusted_proxy_chains &nbsp;&nbsp; &nbsp;[] &nbsp;&nbsp;&nbsp; #<span style=\"\"\">信任代理列表</span><br />http.basic.log &nbsp;&nbsp; &nbsp;false &nbsp;&nbsp;&nbsp; #<span style=\"\"\">把无授权的访问事件添加到</span><span style=\"\"\">ES</span><span style=\"\"\">的日志</span><br />http.basic.xforward &nbsp;&nbsp; &nbsp;&quot;&quot; &nbsp;&nbsp;&nbsp; #<span style=\"\"\">记载代理路径的</span><span style=\"\"\">header</span><span style=\"\"\">字段名</span></p><p><code><br /></code></p>\"', 'JAVA', NULL);
INSERT INTO `vulnerabilities` VALUES (1095, 'ElasticSearch 小于 1.4.5 1.5.2 目录遍历漏洞', 'CVE-2015-5531', 'CNNVD-201507-666', 'high', '目录遍历', '该系统存在目录遍历漏洞，涉及的版本&lt;1.4.5 / &lt;1.5.2', '<p>建议升级：</p><p><span style=\"\"><span style=\"><a href=\"https://www.elastic.co/downloads/past-releases\">https://www.elastic.co/downloads/past-releases</a></span></span></p>', 'JAVA', NULL);
INSERT INTO `vulnerabilities` VALUES (1099, 'Memcached未授权访问', '', '', 'high', '未授权', '<p>memcached<span style=\">是一套分布式的快取系统，当初是</span><span style=\">Danga Interactive</span><span style=\">为了</span><span style=\">LiveJournal</span><span style=\">所发展的，但被许多软件（如</span><span style=\">MediaWiki</span><span style=\">）所使用。这是一套开放源代码软件，以</span><span style=\">BSD license</span><span style=\">授权协议发布。目标</span><span style=\">memcached</span><span style=\">未授权访问，</span><span style=\">memcached</span><span style=\">中存储的数据可被攻击者任意查看，导致信息泄露。</span></p>', '<p>1.<span style=\">设置</span><span style=\">memchached</span><span style=\">只允许本地访问</span></p>\r\n<p>/etc/init.d/memcached<span style=\">配置文件中加入</span></p>\r\n<p>IP=127.0.0.1</p>\r\n<p>2.<span style=\">禁止外网访问</span><span style=\">Memcached 11211</span><span style=\">端口</span></p>\r\n<p>Windows:windows+r<span style=\">调用运行</span><span style=\">&gt;</span><span style=\">输入</span><span style=\">secpol.msc</span><span style=\">打开安全策略</span><span style=\">&gt;</span><span style=\">配置</span><span style=\">ip</span><span style=\">安全策略</span><span style=\">&gt;</span><span style=\">禁止外网访问</span><span style=\">11211</span><span style=\">端口</span></p>\r\n<p>Linux:<span style=\">使用如下命令</span><span style=\">[iptables -A INPUT </span><span style=\">&ndash;</span><span style=\">p tcp --dport 11211 -i </span><span style=\">外网网卡名 </span><span style=\">-j drop]</span><span style=\">禁止外网访问</span><span style=\">11211</span><span style=\">端口</span></p>\r\n<p>3.<span style=\">编译时加上&ndash;</span><span style=\">enable-sasl</span><span style=\">，启用</span><span style=\">SASL</span><span style=\">认证</span></p>\r\n<p>&nbsp;</p>', 'Any', NULL);
INSERT INTO `vulnerabilities` VALUES (1108, '任意Url跳转漏洞', '', '', 'low', '其他类型', '<p>url重定向漏洞也称url任意跳转漏洞，网站信任了用户的输入导致恶意攻击，url重定向主要用来钓鱼，比如url跳转中最常见的跳转在登陆口，支付口，也就是一旦登陆将会跳转任意自己构造的网站，如果设置成自己的url则会造成钓鱼。</p><p>验证方式：打开目标页面验证是否跳转到其他页面。</p><p></p><div class=\"media-wrap image-wrap\"><img class=\"media-wrap image-wrap\" src=\"http://p4.qhimg.com/t01cc82312ac7e4b86d.png\"/></div><p> </p>', '<p>1.若跳转的URL事先是可以确定的，包括url和参数的值，则可以在后台先配置好，url参数只需传对应url的索引即可，通过索引找到对应具体url再进行跳转； </p><p>2.若跳转的URL事先不确定，但其输入是由后台生成的（不是用户通过参数传人），则生成好跳转链接然后进行签名，而跳转cg首先需要进行验证签名通过才能进行跳转；</p><p>3.若1和2都不满足，url事先无法确定，只能通过前端参数传入，则必须在跳转的时候对url进行按规则校验：即控制url白名单。</p><p> </p>', 'Any', NULL);
INSERT INTO `vulnerabilities` VALUES (1113, 'Struts2 WebConsole 对外开放', '', '', 'high', '其他类型', '<p><span style=\">目标存在</span>struts2 webconsole<span style=\">。</span><span style=\">Struts2</span><span style=\">是一个基于</span><span style=\">MVC</span><span style=\">设计模式的</span><span style=\">Web</span><span style=\">应用框架。</span><span style=\">struts2 webconsole</span><span style=\">是</span><span style=\">Struts</span><span style=\">官方为了方便开发人员进行</span><span style=\">Debug</span><span style=\">而提供的功能。攻击者可能构造</span><span style=\">ongl</span><span style=\">表达式，进行任意命令执行。</span></p><p><span style=\">验证方式：</span></p><p><span style=\">打开目标页面验证是否存在</span>struts2 webconsole<span style=\">。</span></p><p><span style=\">示例：</span></p><img src=\"http://p6.qhimg.com/t01dc63a3059150fc4e.png\" alt=\"\" /><br />', '<p>1.<span style=\">修改配置文件，关闭调试功能（关闭后</span><span style=\">webconsole</span><span style=\">即使存在也不会生效）</span></p><p><span style=\">在</span>struts.xml<span style=\">中添加如下代码（若已存在，则修改</span><span style=\">value</span><span style=\">为</span><span style=\">False</span><span style=\">）</span></p><p>&lt;constant name=&quot;struts.devMode&quot; value=&quot;False&quot; /&gt;</p><p>2.<span style=\">删除</span><span style=\">webconsole.html</span><span style=\">，参考路径：</span></p><p>struts2-core-*.jarorgapachestruts2interceptordebuggingwebconsole.html</p><br />', 'JAVA', NULL);
INSERT INTO `vulnerabilities` VALUES (1122, 'SSRF 服务端请求伪造', '', '', 'middle', '跨站请求伪造', '<p>检测到目标URL可对指定URL进行请求，可能存在SSRF漏洞。</p>\r\n<p>&nbsp;</p>', '<p>1、关闭不必要的访问点</p><p>2、无法关闭的点请限制好访问范围</p>', 'Any', NULL);
INSERT INTO `vulnerabilities` VALUES (1149, 'zzcms sql注入', 'null', 'null', 'high', 'SQL 注入', '<p>sql注入</p>', '<p>更新版本</p>', 'ASP', NULL);
INSERT INTO `vulnerabilities` VALUES (1150, 'Adobe ColdFusion 文件读取漏洞（CVE-2010-2861）', 'CVE-2010-2861', NULL, 'high', '任意文件读取', '<p style=\"text-align:start;text-indent:2em;\">Adobe ColdFusion是美国Adobe公司的一款动态Web服务器产品，其运行的CFML（ColdFusion Markup Language）是针对Web应用的一种程序设计语言。</p><p style=\"text-align:start;text-indent:2em;\">Adobe ColdFusion 8、9版本中存在一处目录穿越漏洞，可导致未授权的用户读取服务器任意文件。</p>', '<p>升级版本</p>', 'Any', NULL);
INSERT INTO `vulnerabilities` VALUES (1151, 'FineReport v8.0 Getshell', NULL, NULL, 'high', '命令执行', '<p>帆软报表v8.0 <span style=\"color:#4c4c4c\"><span style=\"font-size:15px\"><span style=\"background-color:#ffffff\">fr-chart-8.0.jar 存在任意文件读取和后台GETSHELL漏洞。</span></span></span></p>', '<p><span style=\"color:#4c4c4c\"><span style=\"font-size:15px\"><span style=\"background-color:#ffffff\">cms官网：</span></span></span><a href=\"http://www.finereport.com/product/download\" target=\"_blank\" rel=\"noopener\">http://www.finereport.com/product/download</a></p><p><span style=\"color:#4c4c4c\"><span style=\"font-size:15px\"><span style=\"background-color:#ffffff\">官网版本已修复。</span></span></span></p>', 'JAVA', NULL);
INSERT INTO `vulnerabilities` VALUES (1152, 'phpshe 1.7 sql注入', 'CVE-2019-6708', 'CNNVD-201901-843', 'high', NULL, '<p><span style=\"color:#585858\"><span style=\"font-size:16px\"><span style=\"background-color:#ffffff\">PHPSHE是一套网上商城系统。该系统支持快递跟踪、在线聊天、订单评价和数据统计等功能。 PHPSHE 1.7版本中存在SQL注入漏洞。远程攻击者可借助‘state’参数利用该漏洞执行SQL命令。</span></span></span></p>', '<p>升级版本</p>', 'PHP', NULL);
INSERT INTO `vulnerabilities` VALUES (1153, 'Apache solr XML 实体注入漏洞（CVE-2017-12629）', 'CVE-2017-12629', 'CNNVD-201710-501', 'high', '命令执行', '<p><span style=\"font-size:16px\"><span style=\"background-color:#ffffff\"><span style=\"color:#333333\">Apache Solr 是一个开源的搜索服务器。Solr 使用 Java 语言开发，主要基于 HTTP 和 Apache Lucene 实现。原理大致是文档通过Http利用XML加到一个搜索集合中。查询该集合也是通过 http收到一个XML/JSON响应来实现。此次7.1.0之前版本总共爆出两个漏洞：XML实体扩展漏洞（XXE）和远程命令执行漏洞（RCE），二者可以连接成利用链，编号均为CVE-2017-12629。</span></span></span></p>', '<p>1.建议受影响的用户升级至官方最新版本</p><p></p><p>2.未能及时安装新版的，可限制只允许可信源IP访问</p>', 'JAVA', NULL);
INSERT INTO `vulnerabilities` VALUES (1154, 'Zeroshell 命令注入', 'CVE-2019-12725', 'CNNVD-201907-1141', 'high', '命令执行', '<p><span style=\"color:#585858\"><span style=\"font-size:16px\"><span style=\"background-color:#ffffff\">Zeroshell是一套面向服务器和嵌入式系统的Linux发行版。 Zeroshell 3.9.0版本中存在安全漏洞，该漏洞源于程序没有正确处理HTTP参数。攻击者可通过注入操作系统命令利用该漏洞执行命令。</span></span></span></p>', '<p>1.建议受影响的用户升级至官方最新版本</p><p></p><p>2.未能及时安装新版的，可限制只允许可信源IP访问</p>', 'Any', NULL);
INSERT INTO `vulnerabilities` VALUES (1155, '迅优cms 任意文件读取漏洞', NULL, NULL, 'middle', '任意文件读取', '<p><span style=\"color:#3e3e3e\"><span style=\"font-size:14px\">迅优cms存在任意文件读取漏洞。攻击者可利用漏洞获取敏感信息。</span></span></p>', '<p>关注厂商主页及时更新：http://www.cnxunchi.com/</p>', 'Any', NULL);
INSERT INTO `vulnerabilities` VALUES (1157, 'Nexus Repository Manager 3 远程命令执行漏洞', 'CVE-2019-7238', NULL, 'high', NULL, '<p>Nexus Repository Manager 3 是一款软件仓库，可以用来存储和分发Maven、NuGET等软件源仓库。</p><p>其3.14.0及之前版本中，存在一处基于OrientDB自定义函数的任意JEXL表达式执行功能，而这处功能存在未授权访问漏洞，将可以导致任意命令执行漏洞。</p>', '<p>1.建议受影响的用户升级至官方最新版本</p><p></p><p>2.未能及时安装新版的，可限制只允许可信源IP访问</p>', 'Any', NULL);
INSERT INTO `vulnerabilities` VALUES (1158, 'WordPress Nevma Adaptive Images 插件安全漏洞', 'CVE-2019-14205', 'CNNVD-201907-1151', 'middle', '信息泄漏', '<p style=\"text-align:start;text-indent:2em;\">WordPress是WordPress基金会的一套使用PHP语言开发的博客平台。该平台支持在PHP和MySQL的服务器上架设个人博客网站。Nevma Adaptive Images plugin是使用在其中的一个图片自适应插件。</p><p style=\"text-align:start;text-indent:2em;\">WordPress Nevma Adaptive Images插件0.6.67之前版本中存在本地文件包含漏洞。远程攻击者可借助adaptive-images-script.php文件的‘$REQUEST[‘adaptive-images-settings’][‘source_file’]’参数利用该漏洞检索任意文件。</p>', '<p>1.建议受影响的用户升级至官方最新版本</p><p></p><p>2.未能及时安装新版的，可限制只允许可信源IP访问</p>', 'PHP', NULL);
INSERT INTO `vulnerabilities` VALUES (1159, 'Joomla configuration.php 远程命令执行漏洞', NULL, 'CNVD-2019-34135', 'high', NULL, '<p>Joomla!是一套使用PHP和MySQL开发的开源、跨平台的内容管理系统(CMS)。</p><p> Joomla! configuration.php文件存在RCE漏洞。攻击者可利用漏洞写入一句话木马，获得服务器权限。</p>', '<p>关注厂商补丁 https://www.joomla.org/</p>', 'PHP', NULL);
INSERT INTO `vulnerabilities` VALUES (1160, 'vBulletin 5.x 前台代码执行漏洞', 'CVE-2019-16759', 'CNNVD-201909-1101', 'high', '命令执行', '<p><span style=\"color:#585858\"><span style=\"font-size:16px\"><span style=\"background-color:#ffffff\">vBulletin是美国InternetBrands和vBulletinSolutions公司的一款基于PHP和MySQL的开源Web论坛程序。 vBulletin 5.x版本至5.5.4版本中存在安全漏洞。攻击者可借助‘widgetConfig[code]’参数利用该漏洞执行命令。</span></span></span></p>', '<p>1.建议受影响的用户升级至官方最新版本</p><p></p><p>2.未能及时安装新版的，可限制只允许可信源IP访问</p>', 'Any', NULL);
INSERT INTO `vulnerabilities` VALUES (1162, 'Dedecms 5.7 guestbook sql注入', NULL, NULL, 'high', 'SQL 注入', '<p>Dedecms 5.7 guestbook sql注入</p>', '<p>更新至安全版本。</p>', 'PHP', NULL);
INSERT INTO `vulnerabilities` VALUES (1163, '泛微OA ecology syncuserinfo sql注入', NULL, NULL, 'high', 'SQL 注入', '<p><span style=\"color:#333333\"><span style=\"font-size:15px\"><span style=\"letter-spacing:0.75px\"><span style=\"background-color:#ffffff\">泛微e-cology OA系统的</span></span></span></span>syncuserinfo<span style=\"color:#333333\"><span style=\"font-size:15px\"><span style=\"letter-spacing:0.75px\"><span style=\"background-color:#ffffff\">接口在使用oracle数据库时,由于内置sql语句拼接不严,导致其存在sql注入漏洞。</span></span></span></span></p>', '<p><span style=\"color:#545c61\"><span style=\"font-size:15px\"><span style=\"letter-spacing:0.5px\"><span style=\"background-color:#fcfcfc\">1.及时更新泛微补丁</span></span></span></span></p><p><span style=\"color:#545c61\"><span style=\"font-size:15px\"><span style=\"letter-spacing:0.5px\"><span style=\"background-color:#fcfcfc\">2.泛微最好不要开放到公网</span></span></span></span></p><p><span style=\"color:#545c61\"><span style=\"font-size:15px\"><span style=\"letter-spacing:0.5px\"><span style=\"background-color:#fcfcfc\">3.使用磐云拦截攻击</span></span></span></span></p>', 'JAVA', NULL);
INSERT INTO `vulnerabilities` VALUES (1164, 'TPshop 小于3.0 前台 sql注入', 'null', 'null', 'high', 'SQL 注入', '<p><a href=\"http://www.tp-shop.cn/\" target=\"_blank\">TPshop</a><span style=\"color:#777777\"><span style=\"font-size:17.5px\"><span style=\"letter-spacing:0.75px\"><span style=\"background-color:#ffffff\">开源商城系统(</span></span></span></span><a href=\"http://www.tp-shop.cn/\" target=\"_blank\">Thinkphp shop</a><span style=\"color:#777777\"><span style=\"font-size:17.5px\"><span style=\"letter-spacing:0.75px\"><span style=\"background-color:#ffffff\">的简称 )，是深圳搜豹网络有限公司开发的一套多商家模式的商城系统。适合企业及个人快速构建个性化网上商城。tpshop&lt;3.0版本前台 /mobile/index/index 页面存在SQL注入漏洞，攻击者可利用该漏洞获取数据库敏感信息。</span></span></span></span></p>', '<p><span style=\"color:#000000\"><span style=\"font-size:16px\"><span style=\"background-color:#ffffff\">关注厂商主页更新： http://www.tp-shop.cn/</span></span></span></p>', 'PHP', NULL);
INSERT INTO `vulnerabilities` VALUES (1165, 'laravel 配置不当导致信息泄露', NULL, NULL, 'middle', '信息泄漏', '<p>laravel 配置不当造成信息泄露。</p>', '<p>修改laravel配置。</p>', 'Any', NULL);
INSERT INTO `vulnerabilities` VALUES (1166, 'ecshop 小于4.1.0 前台 sql注入', NULL, 'CNVD-2020-58823', 'high', NULL, '<p>ECShop是一款专业的电商商城系统。 ECShop 4.1.0存在SQL注入漏洞，攻击者可利用漏洞获取敏感信息。</p>', '<p>4.1.1已修复。建议更新至安全版本。</p>', 'PHP', NULL);
INSERT INTO `vulnerabilities` VALUES (1167, 'pyspider webUI 未授权访问', NULL, NULL, 'high', '命令执行', '<p>pyspider是一个基于python的研发的爬虫系统，功能非常强大。pyspider还带一个webui的界面，用于调度爬虫调试代码。当webui对外开放，而webui本身没有任何形式的验证机制并且允许远程执行python代码。</p>', '<p>禁止webUI对公网开放。</p>', 'Python', NULL);
INSERT INTO `vulnerabilities` VALUES (1168, 'PhpMyAdmin setup 反序列化远程命令执行', NULL, NULL, 'high', NULL, '<p>phpmyadmin 2.x版本中存在一处反序列化漏洞，通过该漏洞，攻击者可以读取任意文件或执行任意代码。</p>', '<p>1.建议受影响的用户升级至官方最新版本</p><p></p><p>2.未能及时安装新版的，可限制只允许可信源IP访问</p>', 'PHP', NULL);
INSERT INTO `vulnerabilities` VALUES (1169, '联通 modem 默认密码', NULL, NULL, 'middle', NULL, '<p>联通 modem 使用默认密码。</p>', '<p>修改账号密码。</p>', 'Any', NULL);
INSERT INTO `vulnerabilities` VALUES (1170, 'Apache Kylin 未授权访问', 'CVE-2020-13937', NULL, 'high', '未授权', '<p style=\"text-align:start;text-indent:2em;\">Apache Kylin是一个开源的分布式分析引擎，它最初由eBay开发，现在是Apache Software Foundation的项目。Apache Kylin建立在Apache Hadoop，Apache Hive，Apache HBase，Apache Parquet，Apache Calcite，Apache Spark和其他技术之上。这些技术使Kylin可以轻松扩展以支持海量数据负载。<br/></p><p style=\"text-align:start;text-indent:2em;\">Apache Kylin 有一个restful api会在没有认可认证的情况下暴露配置信息，攻击者可利用该漏洞获取系统敏感信息。</p>', '<p style=\"text-align:start;text-indent:2em;\">升级到安全版本，或执行以下缓解措施：</p><p style=\"text-align:start;text-indent:2em;\">编辑 &quot;$KYLIN_HOME/WEB-INF/classes/kylinSecurity.xml&quot;；</p><p style=\"text-align:start;text-indent:2em;\">删除下列行 &quot;&lt;scr:intercept-url pattern=&quot;/api/admin/config&quot; access=&quot;permitAll&quot;/&gt;&quot;；</p><p style=\"text-align:start;text-indent:2em;\">重启 Kylin实例以使其生效。</p>', 'Any', NULL);
INSERT INTO `vulnerabilities` VALUES (1171, '泛微 ecology validate sql注入', NULL, NULL, 'high', 'SQL 注入', '<p><span style=\"color:#222222\"><span style=\"font-size:14.4px\"><span style=\"background-color:#ffffff\">泛微官方发布了Ecology OA产品的SQL注入补丁,某安全团队对其进行了分析,成功复现了validate.jsp接口的SQL注入漏洞。</span></span></span></p>', '<p><span style=\"color:#222222\"><span style=\"font-size:14.4px\"><span style=\"background-color:#ffffff\">泛微官方已修复,并发布SQL(1017)注入安全补丁包,请移步</span></span></span><code>https://www.weaver.com.cn/cs/securityDownload.asp</code></p>', 'JAVA', NULL);
INSERT INTO `vulnerabilities` VALUES (1172, 'Ectouch v2 sql注入', NULL, NULL, 'high', 'SQL 注入', '<p>Ectouch v2 存在SQL注入漏洞，攻击者可利用漏洞获取敏感信息。</p>', '<p>1.建议受影响的用户升级至官方最新版本</p><p></p><p>2.未能及时安装新版的，可限制只允许可信源IP访问</p>', 'PHP', NULL);
INSERT INTO `vulnerabilities` VALUES (1173, '绿盟 UTS 管理员任意登录', NULL, NULL, 'high', '信息泄漏', '<p><span style=\"color:#333333\"><span style=\"font-size:16px\"><span style=\"background-color:#ffffff\">此漏洞属于UTS某API存在敏感信息泄露的问题，攻击者可以绕过密码验证登录UTS设备。攻击者利用web特殊请求获取管理员权限，可对设备进行管控，修改防护策略，查看攻击信息和内网地址等资产信息，威胁设备安全。</span></span></span></p>', '<p>联系厂商升级至安全版本。</p>', 'Any', NULL);
INSERT INTO `vulnerabilities` VALUES (1174, 'ThinkPHP v6 任意文件写入', 'null', 'null', 'high', '任意文件写入', '<p>2020年1月10日，ThinkPHP团队发布一个补丁更新，修复了一处由不安全的SessionId 导致的任意文件操作漏洞。该漏洞允许攻击者在目标环境启用session 的条件下创建任意文件以及删除任意文件。 具体受影响版本为ThinkPHP6.0.0-6.0.1 。</p>', '<p>1.建议受影响的用户升级至官方最新版本</p><p></p><p>2.未能及时安装新版的，可限制只允许可信源IP访问</p>', 'Python', NULL);
INSERT INTO `vulnerabilities` VALUES (1175, 'Pulse Secure 任意文件读取 (CVE-2019-11510)', 'CVE-2019-11510', NULL, 'high', NULL, '<p><span style=\"color:#585858\"><span style=\"font-size:16px\"><span style=\"background-color:#ffffff\">从版本8.2开始，Pulse Secure引入了一项名为HTML5 Access的新功能，它是一种用于通过浏览器与Telnet，SSH和RDP交互的功能。由于这个新功能，原始路径验证变得松散。可以在未授权的情况下，造成任意文件读取。</span></span></span></p>', '<p>1.建议受影响的用户升级至官方最新版本</p><p></p><p>2.未能及时安装新版的，可限制只允许可信源IP访问</p>', 'Any', NULL);
INSERT INTO `vulnerabilities` VALUES (1176, 'Seacms v654 远程命令执行', NULL, NULL, 'high', '命令执行', '<p>Seacms v654 远程命令执行</p>', '<p>1.建议受影响的用户升级至官方最新版本</p><p></p><p>2.未能及时安装新版的，可限制只允许可信源IP访问</p>', 'PHP', NULL);
INSERT INTO `vulnerabilities` VALUES (1177, 'Etcd 未授权访问', NULL, NULL, 'middle', '未授权', '<p><span style=\"color:#333333\"><span style=\"font-size:15px\"><span style=\"background-color:#ffffff\">通常etcd数据库会被安装到master节点上，rest api可获取集群内token、证书、账户密码等敏感信息，默认端口为2379。访问路径/v2/keys/?recursive=true，以JSON格式返回存储在服务器上的所有密钥。</span></span></span></p>', '<p>禁止etcd对外开放。</p>', 'Any', NULL);
INSERT INTO `vulnerabilities` VALUES (1178, 'DuomiCMS 3.0 前台duomiphp/ajax.php sql注入', NULL, NULL, 'high', NULL, '<p>多米(DuomiCms)影视管理系统是一套专为影视站长而设计的视频点播系统。 DuomiCms x3.0前台duomiphp/ajax.php文件存在SQL注入漏洞。攻击者可利用漏洞获取数据库敏感信息。</p>', '<p>关注厂商主页及时更新 <span style=\"color:#3e3e3e\"><span style=\"font-size:14px\"><span style=\"background-color:#efefef\">http://www.duomicms.net</span></span></span></p>', 'PHP', NULL);
INSERT INTO `vulnerabilities` VALUES (1179, 'Seacms v8.7 sql注入', NULL, NULL, 'high', 'SQL 注入', '<p>Seacms v8.7存在SQL注入漏洞，攻击者可利用漏洞获取敏感信息。</p>', '<p>1.建议受影响的用户升级至官方最新版本</p><p></p><p>2.未能及时安装新版的，可限制只允许可信源IP访问</p>', 'PHP', NULL);
INSERT INTO `vulnerabilities` VALUES (1180, 'PHPCMS 2008 sql注入', NULL, NULL, 'high', 'SQL 注入', '<p>PHPCMS2008 存在SQL注入漏洞，攻击者可利用漏洞获取敏感信息。</p>', '<p>1.建议受影响的用户升级至官方最新版本</p><p></p><p>2.未能及时安装新版的，可限制只允许可信源IP访问</p>', 'PHP', NULL);
INSERT INTO `vulnerabilities` VALUES (1181, 'nhttpd 远程命令执行 (CVE-2019-16278)', 'CVE-2019-16278', NULL, 'high', '命令执行', '<p style=\"text-align:start;text-indent:2em;\">Nostromo web server(nhttpd)是一个开源的web服务器，在Unix系统非常流行。</p><p style=\"text-align:start;text-indent:2em;\">漏洞原因是web服务在对URL进行检查是在URL被解码前，攻击者可以将/转换为%2f就可绕过检查，之前出现过类似漏洞CVE-2011-0751.</p>', '<p>该项目已不再维护，建议迁移项目。</p>', 'Any', NULL);
INSERT INTO `vulnerabilities` VALUES (1183, 'Dlink 路由器 远程命令执行 (CVE-2019-16920)', 'CVE-2019-16920', NULL, 'middle', '命令执行', '<p style=\"text-align:left;text-indent:2em;\">2019年9月，Fortinet FortiGuard实验室发现并报告了D-Link 产品中的有个非认证的命令注入漏洞——<a href=\"https://nvd.nist.gov/vuln/detail/CVE-2019-16920\">CVE-2019-16920</a>，成功利用该漏洞可以导致远程代码执行。因为该漏洞可以在不经过认证的情况下远程触发，因此研究人员将该漏洞评为中危。</p><p></p>', '<p style=\"text-align:left;\" size=\"0\" _root=\"undefined\" __ownerID=\"undefined\" __hash=\"undefined\" __altered=\"false\">升级至安全版本。</p>', 'Any', NULL);
INSERT INTO `vulnerabilities` VALUES (1184, 'Alibaba Nacos 未授权访问', NULL, NULL, 'high', '未授权', '<p>2020年12月29日，Nacos官方在github发布的issue中披露Alibaba Nacos 存在一个由于不当处理User-Agent导致的未授权访问漏洞 。 通过该漏洞，攻击者可以进行任意操作，包括创建新用户并进行登录后操作。</p>', '<p>1.建议受影响的用户升级至官方最新版本</p><p></p><p>2.未能及时安装新版的，可限制只允许可信源IP访问</p>', 'Any', NULL);
INSERT INTO `vulnerabilities` VALUES (1185, 'WordPress Email 信息泄露漏洞', 'CVE-2019-19985', 'CNNVD-201912-1109', 'middle', '信息泄漏', '<p><span style=\"color:#585858\"><span style=\"font-size:16px\"><span style=\"background-color:#ffffff\">WordPress是WordPress基金会的一套使用PHP语言开发的博客平台。该平台支持在PHP和MySQL的服务器上架设个人博客网站。Email Subscribers ＆ Newsletters是使用在其中的一个电子邮件订阅和新闻通讯插件。 WordPress Email Subscribers ＆ Newsletters 4.2.3之前版本中存在安全漏洞。攻击者可利用该漏洞未经身份验证便可下载文件，造成信息泄露。</span></span></span></p>', '<p>1.建议受影响的用户升级至官方最新版本</p><p></p><p>2.未能及时安装新版的，可限制只允许可信源IP访问</p>', 'PHP', NULL);
INSERT INTO `vulnerabilities` VALUES (1186, 'Cobub Razor 0.8.0 物理路径泄露漏洞', 'CVE-2018-8770', NULL, 'low', '信息泄漏', '<p>Cobub Razor 0.8.0 物理路径泄露</p>', '<p>1.建议受影响的用户升级至官方最新版本</p><p></p><p>2.未能及时安装新版的，可限制只允许可信源IP访问</p>', 'PHP', NULL);
INSERT INTO `vulnerabilities` VALUES (1187, 'Kafka manager 未授权访问', NULL, NULL, 'high', '未授权', '<p><span style=\"color:#4d4d4d\"><span style=\"font-size:16px\"><span style=\"background-color:#ffffff\">kafka-manager是kafka集群管理工具，由雅虎开源，用户可以在Web界面执行一些简单的集群管理操作。对外开放攻击者可利用其对集群进行渗透。</span></span></span></p>', '<p>1.建议受影响的用户升级至官方最新版本</p><p></p><p>2.未能及时安装新版的，可限制只允许可信源IP访问</p>', 'Any', NULL);
INSERT INTO `vulnerabilities` VALUES (1188, 'YouPHPTube Encoder 远程命令执行', 'cve-2019-5129', NULL, 'high', '命令执行', '<p style=\"text-align:start;text-indent:2em;\">YouPHPTube是一个开源的视频共享网站应用。使用YouPHPTube，用户可以创建自己的视频共享网站，YouPHPTube 将帮助用户导入和编码来自Youtube，Vimeo 等其他网站的视频，用户可以直接在自己的网站上进行分享。</p><p style=\"text-align:start;text-indent:2em;\">YouPHPTube Encoder是YouPHPTube的编码器插件，该插件可在YouPHPTube中提供编码器功能。使用者在自己的服务器上安装并使用YouPHPTube Encoder以取代第三方公共编码器服务器，可以更快速便捷的编码自己的视频，并且还可以使用私有方式对自己的视频进行编码。</p><p style=\"text-indent:2em;\"><span style=\"color:#333333\"><span style=\"font-size:15px\"><span style=\"letter-spacing:0.75px\"><span style=\"background-color:#ffffff\">在YouPHPTube Encoder2.3中，存在无需身份验证的命令注入漏洞。攻击者可以发送包含特定参数的Web请求来触发这些漏洞。</span></span></span></span></p>', '<p>1.建议受影响的用户升级至官方最新版本</p><p></p><p>2.未能及时安装新版的，可限制只允许可信源IP访问</p>', 'Any', NULL);
INSERT INTO `vulnerabilities` VALUES (1189, 'Dedecms V5.6 plus/carbuyaction.php 本地文件包含漏洞', NULL, NULL, 'high', '本地文件包含', '<p>DedeCMS内容管理系统软件采用XML名字空间风格核心模板：模板全部使用文件形式保存，对用户设计模板、网站升级转移均提供很大的便利，健壮的模板标签为站长DIY 自己的网站提供了强有力的支持。 DedeCmsV5.6 存在本地文件漏洞，攻击者可利用漏洞获取敏感信息。</p>', '<p>1.建议受影响的用户升级至官方最新版本</p><p></p><p>2.未能及时安装新版的，可限制只允许可信源IP访问</p>', 'PHP', NULL);
INSERT INTO `vulnerabilities` VALUES (1190, 'opentsdb 远程代码执行 (CVE-2020-35476)', 'CVE-2020-35476', NULL, 'high', '命令执行', '<p>OpenTSDB(Open Time Series Data Base)是基于HBASE构建的分布式、可扩展的时间序列数据库。OpenTSDB可以获取电力行业、化工行业、物联网行业等各类型实时监测、检查与分析设备所采集、产生的时间序列数据，并提供存储、索引以及图形化服务，使其易于访问和可视化。</p><p>OpenTSDB 2.4.0及之前版本中存在远程代码执行漏洞，用户提交的yrange参数或其他相关参数的值在/src/tsd/GraphHandler.java文件中进行简单的反引号及其编码过滤处理后会被直接写入到/tmp目录下的gnuplot文件中。</p><p>而该gnuplot文件会被OpenTSDB目录下的/src/mygnuplot.sh脚本调用执行，攻击者可使用其他方式进行绕过上述限制，通过命令注入的方式触发远程代码执行漏洞。</p>', '<p>1.建议受影响的用户升级至官方最新版本</p><p></p><p>2.未能及时安装新版的，可限制只允许可信源IP访问</p>', 'JAVA', NULL);
INSERT INTO `vulnerabilities` VALUES (1191, 'NUUO v3.0.8 本地文件包含', NULL, NULL, 'middle', '本地文件包含', '<p style=\"text-align:center;text-indent:2em;\" class=\"pull-left\" id=\"j-vul-title\" data-vul-id=\"92427\">NUUO v3.0.8 多个型号视频产品 css_parser.php 参数css 本地文件泄漏漏洞</p>', '<p>1.建议受影响的用户升级至官方最新版本</p><p></p><p>2.未能及时安装新版的，可限制只允许可信源IP访问</p>', 'Any', NULL);
INSERT INTO `vulnerabilities` VALUES (1192, 'ElasticSearch Groovy 沙盒绕过代码执行漏洞 (CVE-2015-1427)', NULL, NULL, 'middle', '命令执行', '<p style=\"text-align:start;text-indent:2em;\">CVE-2014-3120后，ElasticSearch默认的动态脚本语言换成了Groovy，并增加了沙盒，但默认仍然支持直接执行动态语言。本漏洞：1.是一个沙盒绕过； 2.是一个Goovy代码执行漏洞。</p>', '<p>1.建议受影响的用户升级至官方最新版本</p><p></p><p>2.未能及时安装新版的，可限制只允许可信源IP访问</p>', 'JAVA', NULL);
INSERT INTO `vulnerabilities` VALUES (1193, 'rConfig v3.9.2 未授权RCE (CVE-2019-16663)', 'CVE-2019-16663', NULL, 'high', '命令执行', '<p style=\"text-align:start;\" size=\"0\" _root=\"undefined\" __ownerID=\"undefined\" __hash=\"undefined\" __altered=\"false\">rConfig是一个开放源码的网络设备配置管理实用工具，用于网络工程师对网络设备的配置。</p><p>共两个远程代码执行漏洞。第一个是ajaxServerSettingsChk.php，攻击者可以通过rootUname参数发送精心构造的一个GET请求，触发未授权RCE漏洞。rootUname参数在源文件第2行中定义，随后会在第13行传递给exec函数，攻击者可以构造参数接收内容实现让操作系统执行恶意命令。这个漏洞很容易利用和发现,后面的篇幅中我将介绍如何发现并利用这个漏洞。</p><p>第二个漏洞是在search.crud.php发现的，这文件需要通过身份验证才能触发远程代码执行漏洞。这个漏洞可以通过构造一个包含有两个参数的GET请求触发，<br/>其中searchTerm参数可以包含任意值，但该参数必须存在，才能执行到第63行的exec函数。</p>', '<p>1.建议受影响的用户升级至官方最新版本</p><p></p><p>2.未能及时安装新版的，可限制只允许可信源IP访问</p>', 'Any', NULL);
INSERT INTO `vulnerabilities` VALUES (1194, 'SprintBoot env 未授权访问', NULL, NULL, 'middle', '信息泄漏', '<p style=\"text-align:left;text-indent:2em;\">GET 请求 <code>/env</code> 会直接泄露环境变量、内网地址、配置中的用户名等信息；当程序员的属性名命名不规范，例如 password 写成 psasword、pwd 时，会泄露密码明文；</p><p style=\"text-align:left;text-indent:2em;\">同时有一定概率可以通过 POST 请求 <code>/env</code> 接口设置一些属性，间接触发相关 RCE 漏洞；同时有概率获得星号遮掩的密码、密钥等重要隐私信息的明文。</p>', '<p>严格的访问控制。</p>', 'JAVA', NULL);
INSERT INTO `vulnerabilities` VALUES (1195, 'Drupal sql注入 (CVE-2014-3704)', 'CVE-2014-3704', NULL, 'high', 'SQL 注入', '<p><span style=\"color:#404040\"><span style=\"font-size:16px\"><span style=\"background-color:#ffffff\">cms drupal 7.31 </span></span></span>存在SQL注入漏洞，攻击者可利用漏洞获取敏感信息。</p>', '<p>1.建议受影响的用户升级至官方最新版本</p><p></p><p>2.未能及时安装新版的，可限制只允许可信源IP访问</p>', 'PHP', NULL);
INSERT INTO `vulnerabilities` VALUES (1196, 'DVR 登录绕过漏洞 (CVE-2018-9995)', 'CVE-2018-9995', NULL, 'high', '权限提升', '<p><span style=\"color:#4d4d4d\"><span style=\"font-size:16px\"><span style=\"background-color:#ffffff\">此漏洞允许攻击者通过修改“Cookie: uid=admin” 之后访问特定 DVR 的控制面板，返回此设备的明文管理员凭证。</span></span></span></p>', '<p>1.建议受影响的用户升级至官方最新版本</p><p></p><p>2.未能及时安装新版的，可限制只允许可信源IP访问</p>', 'Any', NULL);
INSERT INTO `vulnerabilities` VALUES (1197, 'Apache Airflow 未授权访问', 'CVE-2020-17526', NULL, 'high', '未授权', '<p style=\"text-align:start;text-indent:2em;\">Apache Airflow是一套用于创建、管理和监控工作流程的开源平台。该平台具有可扩展和动态监控等特点。</p><p style=\"text-align:start;text-indent:2em;\">Apache Airflow 1.10.14之前版本存在错误会话漏洞，该漏洞源于不正确的会话验证，允许站点A上的airflow用户正常登录，从而通过站点A上的会话访问站点B上未经授权的Airflow Web服务器。但漏洞并不影响已经改变[webserver] secret_key的默认值的用户。</p>', '<p style=\"text-align:start;text-indent:2em;\"><strong>1.官方修复建议：</strong></p><p style=\"text-align:start;text-indent:2em;\">Apache已发布修复版本，建议受影响用户及时升级。</p><p style=\"text-align:start;text-indent:2em;\">下载链接：https://github.com/apache/airflow</p><p style=\"text-align:start;text-indent:2em;\"><strong>2.临时缓解措施：</strong></p><p style=\"text-align:start;text-indent:2em;\">官方建议可通过更改“ [webserver] secret_key”配置的默认值的方法临时缓解漏洞影响。</p>', 'JAVA', NULL);
INSERT INTO `vulnerabilities` VALUES (1198, 'Flink jobmanage 任意文件读取 (CVE-2020-17519)', 'CVE-2020-17519', NULL, 'high', '目录穿越', '<p><span style=\"color:#333333\"><span style=\"font-size:16px\"><span style=\"background-color:#ffffff\">Apache Flink 1.11.0-1.11.2中引入的一项更改，允许攻击者通过JobManager进程的REST接口读取本地文件系统上的任何文件，访问仅限于JobManager进程可访问的文件。</span></span></span></p>', '<p>1.建议受影响的用户升级至官方最新版本</p><p></p><p>2.未能及时安装新版的，可限制只允许可信源IP访问</p>', 'Any', NULL);
INSERT INTO `vulnerabilities` VALUES (1199, 'Spring Security OAuth2 远程命令执行漏洞（CVE-2016-4977）', 'CVE-2016-4977', NULL, 'middle', '命令执行', '<p>Spring Security OAuth 是为 Spring 框架提供安全认证支持的一个模块，在7月5日其维护者发布了这样一个升级公告，主要说明在用户使用Whitelabel views来处理错误时，攻击者在被授权的情况下可以通过构造恶意参数来远程执行命令。</p>', '<p>使用 1.0.x 版本的用户应放弃在认证通过和错误这两个页面中使用Whitelabel这个视图。</p><p>使用 2.0.x 版本的用户升级到 2.0.10 以及更高的版本</p>', 'JAVA', NULL);
INSERT INTO `vulnerabilities` VALUES (1200, 'Xiuno BBS 系统重装漏洞', NULL, 'CNVD-2019-01348', 'middle', '配置错误', '<p><span style=\"color:#363636\"><span style=\"font-size:15px\"><span style=\"background-color:#ffffff\">Xiuno BBS是一套开源的轻量级论坛系统。Xiuno BBS系统存在系统重装漏洞。该漏洞源于系统安装完毕后未对安装目录进行任何防护或过滤，攻击者可直接通过安装页面重装系统。</span></span></span></p>', '<p><span style=\"color:#363636\"><span style=\"font-size:15px\"><span style=\"background-color:#ffffff\">厂商尚未提供漏洞修复方案，请关注厂商主页更新：https://bbs.xiuno.com/</span></span></span></p>', 'Any', NULL);
INSERT INTO `vulnerabilities` VALUES (1201, 'Consul Service API远程命令执行漏洞', NULL, NULL, 'high', '命令执行', '<p style=\"text-align:start;text-indent:2em;\" class=\"shortdesc\" data-aplus-ae=\"x1_7f043b1a\" data-spm-anchor-id=\"a2c4g.11186623.2.i0.796d4b34ydWqxG\">2018年11月27日，Consul在官方博客中发布了关于Consul工具在特定配置下可能导致远程命令执行（RCE）漏洞的公告，并描述了防护该漏洞的配置方案。</p><p style=\"text-align:start;text-indent:2em;\" class=\"p\" id=\"p-mgy-sgv-la7\" data-spm-anchor-id=\"a2c4g.11186623.2.i8.796d4b34ydWqxG\">Consul是HashiCorp公司推出的一款开源工具，用于实现分布式系统的服务发现与配置。同其他分布式服务注册与发现的方案相比，Consul提供的方案更为一站式。Consul内置了服务注册与发现框架、分布一致性协议实现、健康检查、Key-Value存储、多数据中心方案，不再需要依赖其他工具（例如ZooKeeper等），使用方式也相对简单。</p><p style=\"text-align:start;text-indent:2em;\" class=\"p\" id=\"p-q71-bng-4k4\">Consul使用Go语言编写，因此具有天然的可移植性（支持Linux、Windows和Mac OS X系统），且安装包中仅包含一个可执行文件，便于部署，可与Docker等轻量级容器无缝配合。</p><p style=\"text-indent:2em;\">在特定配置下，恶意攻击者可以通过发送精心构造的HTTP请求在未经授权的情况下在Consul服务端远程执行命令。</p>', '<ul><li>禁用Consul服务器上的脚本检查功能。</li><li>如果您需要使用Consul的脚本检查功能，请升级至0.9.4、1.0.8、1.1.1、1.2.4中的任意一个版本（这些版本中包含-enable-local-script-checks参数），将Consul配置中的-enable-script-checks更改为-enable-local-script-checks。</li><li>确保Consul HTTP API服务无法通过外网访问或调用。</li></ul>', 'Any', NULL);
INSERT INTO `vulnerabilities` VALUES (1202, '风讯DotNetCMS V1.0~V2.0 SQL注入漏洞', NULL, NULL, 'middle', 'SQL 注入', '<p>风讯DotNetCMS V1.0~V2.0 存在SQL注入漏洞，攻击者可利用漏洞获取敏感信息。</p>', '<p>1.建议受影响的用户升级至官方最新版本</p><p></p><p>2.未能及时安装新版的，可限制只允许可信源IP访问</p>', 'PHP', NULL);
INSERT INTO `vulnerabilities` VALUES (1203, 'Thinkadmin v6任意文件读取漏洞（CVE-2020-25540）', 'CVE-2020-25540', NULL, 'middle', '任意文件读取', '<p><span style=\"color:#333333\"><span style=\"font-size:16px\"><span style=\"background-color:#ffffff\">ThinkAdmin是一套基于ThinkPHP框架的通用后台管理系统，ThinkAdmin 的权限管理基于标准RBAC简化而来，去除了繁杂的节点管理，使得权限管理起来更简单，具体包含节点管理、权限管理、菜单管理、用户管理。ThinkAdmin 6版本存在路径遍历漏洞。攻击者可利用该漏洞通过GET请求编码参数任意读取远程服务器上的文件。</span></span></span></p>', '<p>1.建议受影响的用户升级至官方最新版本</p><p></p><p>2.未能及时安装新版的，可限制只允许可信源IP访问</p>', 'PHP', NULL);
INSERT INTO `vulnerabilities` VALUES (1204, 'phpmyadmin 4.8.1 远程文件包含漏洞（CVE-2018-12613）', 'CVE-2018-12613', NULL, 'middle', '远程文件包含', '<p>phpMyAdmin是一套开源的、基于Web的MySQL数据库管理工具。其index.php中存在一处文件包含逻辑，通过二次编码即可绕过检查，造成远程文件包含漏洞。</p>', '<p>1.建议受影响的用户升级至官方最新版本</p><p></p><p>2.未能及时安装新版的，可限制只允许可信源IP访问</p>', 'PHP', NULL);
INSERT INTO `vulnerabilities` VALUES (1205, 'Terramaster TOS 命令注入漏洞', 'CVE-2020-28188', 'CNNVD-202012-1548', 'high', '命令执行', '<p>Terramaster TOS是中国深圳市图美电子技术（Terramaster）公司的一款基于Linux平台的，专用于erraMaster云存储NAS服务器的操作系统。 TerraMaster TOS 4.2.06版本及之前版本存在注入漏洞，攻击者可利用该漏洞通过在事件参数中包含makecvs.php注入操作系统命令。</p>', '<p>1.建议受影响的用户升级至官方最新版本</p><p></p><p>2.未能及时安装新版的，可限制只允许可信源IP访问</p>', 'Any', NULL);
INSERT INTO `vulnerabilities` VALUES (1206, 'Discuz!ML 3.x 任意代码执行漏洞', NULL, 'CNVD-2019-22239', 'high', '命令执行', '<p>Discuz!ML是基于Discuz!X引擎的一款多语种开源代码社区系统。Discuz!ML 3.x存在任意代码执行漏洞，攻击者可利用该漏洞执行任意代码。<br/></p><p><br/></p>', '<p>厂商尚未提供漏洞修复方案，请关注厂商主页更新：https://discuz.ml/<br/></p><p><br/></p>', 'PHP', NULL);
INSERT INTO `vulnerabilities` VALUES (1207, 'laravel debug 信息泄露', NULL, NULL, 'middle', '信息泄漏', '<p style=\"text-align:start;text-indent:2em;\">在laravel框架的.env配置文件中，默认调试功能debug是开启的。当使程序报错时。在前台会返回报错详情、环境变量、服务器配置等敏感信息。比如用服务器不允许的方法向服务器发起一个请求。报错中可以看到应用的绝对路径、session、mysql账号密码、邮箱账号密码、redis密码都暴露在了前端。知道这些密码以后，黑客可以利用mysql写入木马，利用mysql在服务器上进行提权，或者直接脱库。redis默认是以root权限运行，攻击者拿到redis密码后很容易取得redis的root权限，当作跳板入侵其他内网机器。</p><p></p>', '<p style=\"text-align:start;text-indent:2em;\">1、关闭laravel配置文件中的调试功能，在.env文件中找到APP_DEBUG=true，将true改为false。</p><p style=\"text-align:start;text-indent:2em;\">2、在根目录下添加.htaccess文件，仅限Apache，可以禁止直接访问127.0.0.1/laravel/.env</p>', 'Any', NULL);
INSERT INTO `vulnerabilities` VALUES (1208, 'ThinkPHP5 5.0.23 远程代码执行漏洞', NULL, NULL, NULL, '命令执行', '<p style=\"text-align:start;text-indent:2em;\">ThinkPHP是一款运用极广的PHP开发框架。其5.0.23以前的版本中，获取method的方法中没有正确处理方法名，导致攻击者可以调用Request类任意方法并构造利用链，从而导致远程代码执行漏洞。</p>', '<p>1.建议受影响的用户升级至官方最新版本</p><p></p><p>2.未能及时安装新版的，可限制只允许可信源IP访问</p>', 'PHP', NULL);
INSERT INTO `vulnerabilities` VALUES (1210, 'Intellian Aptus Web 操作系统命令注入漏洞', NULL, NULL, 'high', '命令执行', '<p><span style=\"color:#585858\"><span style=\"font-size:16px\"><span style=\"background-color:#ffffff\">Intellian Aptus Web 1.24版本中存在操作系统命令注入漏洞。远程攻击者可借助JSON数据中的Q字段利用该漏洞执行任意操作系统命令。部分情况下需要有效的认证cookie才能登录并触发漏洞，目前相关的利用方式已经公开，经过验证，使用公开的poc可成功触发漏洞。</span></span></span></p>', '<p style=\"text-align:left;\" size=\"0\" _root=\"undefined\" __ownerID=\"undefined\" __hash=\"undefined\" __altered=\"false\">1.建议受影响的用户升级至官方最新版本</p><p>2.未能及时安装新版的，可限制只允许可信源IP访问</p><p></p>', 'Any', NULL);
INSERT INTO `vulnerabilities` VALUES (1211, 'CactiEZ weathermap 插件任意文件写入', NULL, NULL, 'high', '文件上传', '<p>世纪互联CactiEZ中文版登录页面存在weathermap插件任意文件写入。</p>', '<p>1. 限制或认证访问 </p><p>2. 清查服务器后门</p>', 'Any', NULL);
INSERT INTO `vulnerabilities` VALUES (1212, 'Citrix ADC 未授权 (CVE-2020-8193)', 'CVE-2020-8193', NULL, NULL, NULL, '<p><span style=\"color:#333333\"><span style=\"font-size:15px\"><span style=\"background-color:#ffffff\">Citrix官方发布漏洞公告，其中5个漏洞影响较大，分别为CVE-2020-8191、CVE-2020-8193、CVE-2020-8194、CVE-2020-8195、CVE-2020-8196。 其中8191为xss漏洞，8193为未授权访问漏洞，8194为代码注入漏洞，8195和8196为信息泄露漏洞。</span></span></span></p>', '<p style=\"text-align:start;text-indent:2em;\" cid=\"n132\" mdtype=\"paragraph\" class=\"md-end-block md-p\">1.建议受影响的用户升级至官方最新版本</p><p style=\"text-align:start;text-indent:2em;\" cid=\"n133\" mdtype=\"paragraph\" class=\"md-end-block md-p\">2.未能及时安装新版的，可限制只允许可信源IP访问</p>', 'Any', NULL);
INSERT INTO `vulnerabilities` VALUES (1213, 'WordPress Mailpress Plugin 远程代码执行漏洞', NULL, NULL, 'high', '命令执行', '<p><span style=\"color:#555555\"><span style=\"font-size:15px\"><span style=\"background-color:#ffffff\">Mailpress是一个比较流行的邮件插件。WordPress Mailpress Plugin 插件中, mailpress/mp-includes/class/MP_Actions.class.php 文件中 iview 函数中 subject 参数未经过滤，直接拼接do_eval函数执行代码，而do_eval函数也未经任何过滤，导致远程代码执行漏洞。</span></span></span></p>', '<p style=\"text-align:start;text-indent:2em;\" cid=\"n132\" mdtype=\"paragraph\" class=\"md-end-block md-p\">1.建议受影响的用户升级至官方最新版本</p><p style=\"text-align:start;text-indent:2em;\" cid=\"n133\" mdtype=\"paragraph\" class=\"md-end-block md-p md-focus\">2.未能及时安装新版的，可限制只允许可信源IP访问</p>', 'PHP', NULL);
INSERT INTO `vulnerabilities` VALUES (1214, 'CraftCMS 模板注入 远程命令执行', 'CVE-2020-9757', 'CNNVD-202003-181', 'high', '命令执行', '<p><span style=\"color:#585858\"><span style=\"font-size:16px\"><span style=\"background-color:#ffffff\">Craft CMS是一套内容管理系统（CMS）。Seomatic是其中的一个SEO（搜索引擎优化）组件。 Seomatic 3.3.0之前版本（用于Craft CMS）中存在安全漏洞。攻击者可利用该漏洞向服务器端注入模板，获取信息。</span></span></span></p>', '<p style=\"text-align:start;text-indent:2em;\" cid=\"n132\" mdtype=\"paragraph\" class=\"md-end-block md-p\">1.建议受影响的用户升级至官方最新版本</p><p style=\"text-align:start;text-indent:2em;\" cid=\"n133\" mdtype=\"paragraph\" class=\"md-end-block md-p md-focus\">2.未能及时安装新版的，可限制只允许可信源IP访问</p>', 'Any', NULL);
INSERT INTO `vulnerabilities` VALUES (1216, '用友 NC 通用文件包含漏洞', NULL, NULL, 'middle', '任意文件读取', '<p>用友ERP-NC某处通用文件包含漏洞，可以遍历各种系统文件。<span style=\"color:#000000\"><span style=\"font-size:13px\"><span style=\"background-color:#ffffff\">http://**.**.**.**/NCFindWeb?service=IPreAlertConfigService&amp;filename=../../../../../etc/passwd</span></span></span></p>', '<p style=\"text-align:start;text-indent:2em;\" cid=\"n132\" mdtype=\"paragraph\" class=\"md-end-block md-p md-focus\">1.建议受影响的用户升级至官方最新版本</p><p style=\"text-align:start;text-indent:2em;\" cid=\"n133\" mdtype=\"paragraph\" class=\"md-end-block md-p\">2.未能及时安装新版的，可限制只允许可信源IP访问</p>', 'JAVA', NULL);
INSERT INTO `vulnerabilities` VALUES (1217, 'Spring Cloud Config Server 路径穿越与任意文件读取 (CVE-2019-3799)', 'CVE-2019-3799', 'CNNVD-201904-820', 'high', '任意文件读取', '<p><span style=\"color:#585858\"><span style=\"font-size:16px\"><span style=\"background-color:#ffffff\">Pivotal Software Spring Cloud Config是美国Pivotal Software公司的一套分布式系统的配置管理解决方案。该产品主要为分布式系统中的外部配置提供服务器和客户端支持。 Spring Cloud Config中存在目录遍历漏洞，该漏洞源于网络系统或产品未能正确地过滤资源或文件路径中的特殊元素。攻击者可利用该漏洞访问受限目录之外的位置。以下版本受到影响：Spring Cloud Config 2.1.2之前的2.1.x版本，2.0.4之前的2.0.x版本，1.4.6之前的1.4.x版本，不再支持的老版本。</span></span></span></p>', '<p style=\"text-align:start;text-indent:2em;\" cid=\"n132\" mdtype=\"paragraph\" class=\"md-end-block md-p md-focus\">1.建议受影响的用户升级至官方最新版本</p><p style=\"text-align:start;text-indent:2em;\" cid=\"n133\" mdtype=\"paragraph\" class=\"md-end-block md-p\">2.未能及时安装新版的，可限制只允许可信源IP访问</p>', 'JAVA', NULL);
INSERT INTO `vulnerabilities` VALUES (1218, 'PHPOK sql注入 (CVE-2020-16629)', 'CVE-2020-16629', 'CNNVD-202102-625', NULL, NULL, '<p>PHPOK是一套支持扩展的企业建站系统。 PhpOK 5.4.137版本存在SQL注入漏洞，该漏洞源于基于数据库的应用缺少对外部输入SQL语句的验证。攻击者可以通过SQL注入附件数据，然后通过api.php调用附件替换函数，将PHP文件写入目标路径。</p>', '<p style=\"text-align:start;text-indent:2em;\" cid=\"n132\" mdtype=\"paragraph\" class=\"md-end-block md-p\">1.建议受影响的用户升级至官方最新版本</p><p style=\"text-align:start;text-indent:2em;\" cid=\"n133\" mdtype=\"paragraph\" class=\"md-end-block md-p md-focus\">2.未能及时安装新版的，可限制只允许可信源IP访问</p>', 'PHP', NULL);
INSERT INTO `vulnerabilities` VALUES (1219, 'Gila CMS SQL注入漏洞 (CVE-2020-5515)', 'CVE-2020-5515', 'CNNVD-202001-141', NULL, 'SQL 注入', '<p>Gila CMS是一套基于PHP和MySQL的开源内容管理系统（CMS）。 Gila CMS 1.11.8版本中的/admin/sql?query=存在SQL注入漏洞。该漏洞源于基于数据库的应用缺少对外部输入SQL语句的验证。攻击者可利用该漏洞执行非法SQL命令。</p><p><br/></p>', '<p style=\"text-align:start;text-indent:2em;\" cid=\"n132\" mdtype=\"paragraph\" class=\"md-end-block md-p\">1.建议受影响的用户升级至官方最新版本</p><p style=\"text-align:start;text-indent:2em;\" cid=\"n133\" mdtype=\"paragraph\" class=\"md-end-block md-p md-focus\">2.未能及时安装新版的，可限制只允许可信源IP访问</p>', 'PHP', NULL);
INSERT INTO `vulnerabilities` VALUES (1220, 'ZEIT Next.js 路径遍历漏洞', 'CVE-2017-16877', 'CNNVD-201711-711', 'middle', NULL, '<p>ZEITNext.js是一款开源的通用webapps开发框架。ZEITNext.js2.4.1之前的版本中存在目录遍历漏洞。攻击者可利用该漏洞获取敏感信息。</p><p><br/></p>', '<p style=\"text-align:start;text-indent:2em;\" cid=\"n132\" mdtype=\"paragraph\" class=\"md-end-block md-p\">1.建议受影响的用户升级至官方最新版本</p><p style=\"text-align:start;text-indent:2em;\" cid=\"n133\" mdtype=\"paragraph\" class=\"md-end-block md-p md-focus\">2.未能及时安装新版的，可限制只允许可信源IP访问</p>', 'Any', NULL);
INSERT INTO `vulnerabilities` VALUES (1221, 'Nagios XI SQL注入漏洞 (CVE-2018-10736)', 'CVE-2018-10736', 'CNNVD-201805-493', 'middle', 'SQL 注入', '<p>NagiosXI是美国Nagios公司的一套IT基础设施监控解决方案。该方案支持对应用、服务、操作系统等进行监控和预警。NagiosXI5.4.13之前版本中存在SQL注入漏洞。远程攻击者可借助‘key1’参数利用该漏洞执行任意的SQL命令。</p><p></p>', '<p style=\"text-align:start;text-indent:2em;\" cid=\"n132\" mdtype=\"paragraph\" class=\"md-end-block md-p\">1.建议受影响的用户升级至官方最新版本</p><p style=\"text-align:start;text-indent:2em;\" cid=\"n133\" mdtype=\"paragraph\" class=\"md-end-block md-p md-focus\">2.未能及时安装新版的，可限制只允许可信源IP访问</p>', 'Any', NULL);
INSERT INTO `vulnerabilities` VALUES (1222, 'Odoo 12.0 本地文件读取', NULL, NULL, 'middle', '任意文件读取', '<p><span style=\"color:#333333\"><span style=\"font-size:14px\"><span style=\"background-color:#ffffff\">Odoo 12.0 存在本地文件读取</span></span></span></p>', '<p style=\"text-align:start;text-indent:2em;\" cid=\"n132\" mdtype=\"paragraph\" class=\"md-end-block md-p\">1.建议受影响的用户升级至官方最新版本</p><p style=\"text-align:start;text-indent:2em;\" cid=\"n133\" mdtype=\"paragraph\" class=\"md-end-block md-p md-focus\">2.未能及时安装新版的，可限制只允许可信源IP访问</p>', 'Any', NULL);
INSERT INTO `vulnerabilities` VALUES (1223, 'Fortinet FortiOS 路径遍历漏洞 (CVE-2018-13379)', 'CVE-2018-13379', 'CNNVD-201905-1026', 'middle', NULL, '<p>Fortinet FortiOS是美国飞塔（Fortinet）公司的一套专用于FortiGate网络安全平台上的安全操作系统。该系统为用户提供防火墙、防病毒、IPSec/SSLVPN、Web内容过滤和反垃圾邮件等多种安全功能。SSL VPN是其中的一个使用安全套接字层协议（SSL）的虚拟私人网络（VPN）组件。 Fortinet FortiOS 5.6.3版本至5.6.7版本和6.0.0版本至6.0.4版本中的SSL VPN Web门户存在路径遍历漏洞。该漏洞源于网络系统或产品未能正确地过滤资源或文件路径中的特殊元素。攻击者可利用该漏洞访问受限目录之外的位置。</p><p><br/></p>', '<p style=\"text-align:start;text-indent:2em;\" cid=\"n132\" mdtype=\"paragraph\" class=\"md-end-block md-p md-focus\">1.建议受影响的用户升级至官方最新版本</p><p style=\"text-align:start;text-indent:2em;\" cid=\"n133\" mdtype=\"paragraph\" class=\"md-end-block md-p\">2.未能及时安装新版的，可限制只允许可信源IP访问</p>', 'Any', NULL);
INSERT INTO `vulnerabilities` VALUES (1224, 'Pandora FMS 命令注入 (CVE-2019-20224)', 'CVE-2019-20224', 'CNNVD-202001-324', NULL, NULL, '<p>Artica Pandora FMS是西班牙Artica公司的一套监控系统。该系统通过可视化的方式监控网络、服务器、虚拟基础架构和应用程序等。 Artica Pandora FMS 7.0NG版本中的functions_netflow.php文件的‘netflow_get_stats’函数存在安全漏洞。攻击者可借助‘ip_src’参数中的shell元字符利用该漏洞执行任意的操作系统命令。</p><p><br/></p>', '<p style=\"text-align:start;text-indent:2em;\" cid=\"n132\" mdtype=\"paragraph\" class=\"md-end-block md-p md-focus\">1.建议受影响的用户升级至官方最新版本</p><p style=\"text-align:start;text-indent:2em;\" cid=\"n133\" mdtype=\"paragraph\" class=\"md-end-block md-p\">2.未能及时安装新版的，可限制只允许可信源IP访问</p>', 'Any', NULL);
INSERT INTO `vulnerabilities` VALUES (1225, 'Golang pprof 信息泄露', NULL, NULL, 'middle', '信息泄漏', '<p>https://cloud.tencent.com/developer/news/312276</p><p></p><p>Go语言的 net/http/pprof 包是令人难以置信的强大的，在这个调试过程，配置不当将造成敏感信息泄露。</p>', '<p><span style=\"color:#333333\"><span style=\"font-size:16px\"><span style=\"background-color:#ffffff\">可限制只允许可信源IP访问</span></span></span></p>', 'Any', NULL);
INSERT INTO `vulnerabilities` VALUES (1226, '方维团购 4.3 sql注入', NULL, NULL, 'middle', 'SQL 注入', '<p><span style=\"color:#333333\"><span style=\"font-size:16px\"><span style=\"background-color:#ffffff\">方维团购 4.3 存在SQL注入漏洞，攻击者可利用漏洞获取数据库敏感信息。</span></span></span></p>', '<p>1.建议受影响的用户升级至官方最新版本</p><p></p><p>2.未能及时安装新版的，可限制只允许可信源IP访问</p>', 'PHP', NULL);
INSERT INTO `vulnerabilities` VALUES (1227, 'DrayTek 命令注入漏洞', 'CVE-2020-8515', 'CNNVD-202002-001', 'high', '命令执行', '<p><span style=\"color:#000000\"><span style=\"font-size:14px\">DrayTek Vigor2960、Vigor3900和Vigor300B中存在安全漏洞。攻击者可通过向cgi-bin/mainfunction.cgi URI发送shell元字符利用该漏洞不经过身份验证以root权限执行代码。以下产品及版本受到影响：DrayTek Vigor2960 1.3.1_Beta版本；Vigor3900 1.4.4_Beta版本；Vigor300B 1.3.3_Beta版本，1.4.2.1_Beta版本，1.4.4_Beta版本。</span></span></p>', '<p>1.建议受影响的用户升级至官方最新版本 <a href=\"https://www.draytek.com/\" target=\"_Blank\">https://www.draytek.com/</a></p><p></p><p>2.未能及时安装新版的，可限制只允许可信源IP访问</p>', 'Any', NULL);
INSERT INTO `vulnerabilities` VALUES (1228, 'Nexus Repository Manager 默认密码', NULL, NULL, 'middle', '弱口令', '<p>发现 Nexus Repository Manager 默认密码</p>', '<p>修改密码</p>', 'Any', NULL);
INSERT INTO `vulnerabilities` VALUES (1229, '三星路由器 WLAN AP WEA453e 未授权RCE', NULL, NULL, NULL, NULL, '<p>三星路由器WLAN AP WEA453e 未授权RCE</p>', '<p>1.建议受影响的用户升级至官方最新版本</p><p></p><p>2.未能及时安装新版的，可限制只允许可信源IP访问</p>', 'Any', NULL);
INSERT INTO `vulnerabilities` VALUES (1230, 'myucms 前台 任意文件读取', NULL, NULL, 'middle', '任意文件下载', '<p>MyuCMS开源内容管理系统采用ThinkPHP开发而成的社区商城。 MyuCMS前台存在任意文件下载漏洞，攻击者可利用该漏洞下载任意文件。</p><p><br/></p>', '<p>厂商已发布了漏洞修复程序，请及时关注更新： http://www.myucms.com/</p><p><br/>未能及时安装新版的，可限制只允许可信源IP访问。</p>', 'PHP', NULL);
INSERT INTO `vulnerabilities` VALUES (1231, 'JBossSeam EL表达式 远程代码执行漏洞', 'CVE-2010-1871', 'CNNVD-201008-019', 'middle', NULL, '<p>JBossSeam是一个JavaEE5框架，把JSF与EJB3.0组件合并在一起，从而为开发基于Web的企业应用程序提供一个最新的模式。JBossSeam处理某些参数化JBossEL表达式的方式存在输入过滤漏洞。如果远程攻击者能够诱骗通过认证的JBossSeam用户访问特制的网页，就可能导致执行任意代码。</p><p></p>', '<p>1.建议受影响的用户升级至官方最新版本</p><p></p><p>2.未能及时安装新版的，可限制只允许可信源IP访问</p>', 'ASP', NULL);
INSERT INTO `vulnerabilities` VALUES (1232, 'Devaldi FlexPape 远程代码执行', 'CVE-2018-11686', 'CNNVD-201903-334', 'high', '命令执行', '<p><span style=\"color:#585858\"><span style=\"font-size:16px\"><span style=\"background-color:#ffffff\">Devaldi FlexPaper是新西兰Devaldi公司的一款基于Web的轻量级PDF文件查看组件。 Devaldi FlexPaper 2.3.6及之前版中存在安全漏洞。远程攻击者可利用该漏洞执行代码。</span></span></span></p>', '<p>1.建议受影响的用户升级至官方最新版本</p><p></p><p>2.未能及时安装新版的，可限制只允许可信源IP访问</p>', 'Any', NULL);
INSERT INTO `vulnerabilities` VALUES (1233, 'Apache OFBiz 任意文件读取', 'CVE-2018-8033', 'CNNVD-201812-685', 'middle', '任意文件读取', '<p><span style=\"color:#585858\"><span style=\"font-size:16px\"><span style=\"background-color:#ffffff\">Apache OFBiz（又名Apache Open For Business Project）是美国阿帕奇（Apache）软件基金会的一套企业资源计划（ERP）系统。该系统提供了一整套基于Java的Web应用程序组件和工具。 Apache OFBiz 16.11.01版本至16.11.04版本中存在安全漏洞。攻击者可利用该漏洞获取主机机密信息。</span></span></span></p>', '<p>1.建议受影响的用户升级至官方最新版本</p><p></p><p>2.未能及时安装新版的，可限制只允许可信源IP访问</p>', 'Any', NULL);
INSERT INTO `vulnerabilities` VALUES (1234, 'MsvodCms SQL注入', 'CVE-2018-14418', 'CNNVD-201807-1724', 'high', 'SQL 注入', '<p>Msvod Cms是一套用于视频点播网站的内容管理系统（CMS）。该系统主要提供视频点播和视频聚合建站等服务。 Msvod Cms 10版本中存在SQL注入漏洞。远程攻击者利用该漏洞执行任意的SQL命令。</p><p><br/></p>', '<p>1.建议受影响的用户升级至官方最新版本</p><p></p><p>2.未能及时安装新版的，可限制只允许可信源IP访问</p>', 'PHP', NULL);
INSERT INTO `vulnerabilities` VALUES (1235, 'PHPStudy Nginx 任意文件解析', NULL, NULL, NULL, NULL, '<p>phpstudy 8.1.07 Nginx 1.5.11 存在任意文件解析。</p>', '<p>1.建议受影响的用户升级至官方最新版本</p><p></p><p>2.未能及时安装新版的，可限制只允许可信源IP访问</p>', 'Any', NULL);
INSERT INTO `vulnerabilities` VALUES (1236, 'NETGEAR 路由器 密码泄露', 'CVE-2017-5521', 'CNNVD-201701-454', 'middle', '信息泄漏', '<p>NETGEARR8500等都是美国网件（NETGEAR）公司的路由器产品。多款NETGEAR产品中存在安全漏洞。攻击者可通过向Web管理服务器发送特制的请求利用该漏洞造成密码泄露。以下产品受到影响：NETGEARR8500；R8300；R7000；R6400；R7300；R7100LG；R6300v2；WNDR3400v3；WNR3500Lv2；R6250；R6700；R6900；R8000。</p><p><br/></p>', '<p>1.建议受影响的用户升级至官方最新版本</p><p></p><p>2.未能及时安装新版的，可限制只允许可信源IP访问</p>', 'Any', NULL);
INSERT INTO `vulnerabilities` VALUES (1237, '致远OA sql注入', NULL, NULL, 'high', 'SQL 注入', '<p>用友 GRP-u8 存在SQL注入漏洞，攻击者可利用漏洞获取数据库敏感信息。</p><p></p>', '<p>1.建议受影响的用户升级至官方最新版本</p><p></p><p>2.未能及时安装新版的，可限制只允许可信源IP访问</p>', 'JAVA', NULL);
INSERT INTO `vulnerabilities` VALUES (1238, 'Apache OFBiz XML 反序列化', NULL, NULL, 'high', '反序列化', '<p>Apache ofbiz 存在 反序列化漏洞，攻击者 通过 访问未授权接口，构造特定的xmlrpc http请求，可以造成 远程代码执行的影响。</p>', '<p>1.建议受影响的用户升级至官方最新版本</p><p></p><p>2.未能及时安装新版的，可限制只允许可信源IP访问</p>', 'JAVA', NULL);
INSERT INTO `vulnerabilities` VALUES (1239, 'Jenkins 未授权访问', NULL, NULL, NULL, NULL, '<p>未授权访问管理控制台,可以通过脚本命令行执行系统命令。通过该漏洞,可以后台管理服务,通过脚本命令行功能执行系统命令,如反弹shell,wget写webshell文件。</p>', '<p>1、对后台控制页面做登录验证限制</p><p>2、升级版本</p>', 'JAVA', NULL);
