INSERT INTO `vulnerabilities` VALUES (1250, 'Drupal api 远程命令执行', 'CVE-2019-6340', NULL, 'high', '命令执行', '<p style=\"text-align:start;text-indent:2em;\">Drupal官方之前更新了一个非常关键的安全补丁，修复了因为接受的反序列化数据过滤不够严格，在开启REST的Web服务拓展模块的情况下，可能导致PHP代码执行的严重安全。</p><p style=\"text-align:start;text-indent:2em;\">根据官方公告和自身实践，8.6.x或（&lt;8.6.10）两种情况可能导致问题出现：</p><ul><li>RESTful Web Services拓展开启，并且启用了REST资源（默认配置即可），不需要区分GET，POST等方法即可完成攻击。</li><li>JSON：API服务模块开启，此服务尚未分析。</li></ul>', '<p>1.建议受影响的用户升级至官方最新版本</p><p></p><p>2.未能及时安装新版的，可限制只允许可信源IP访问</p>', 'PHP', NULL);
