INSERT INTO `vulnerabilities` VALUES (1255, 'Spring Cloud Config目录穿越漏洞 （CVE-2020-5410）', 'CVE-2020-5410', NULL, 'middle', '目录穿越', '<p style=\"text-align:start;text-indent:2em;\">Spring Cloud Config，2.2.3之前的2.2.x版本，2.1.9之前的2.1.x版本以及较旧的不受支持的版本允许应用程序通过spring-cloud-config-server模块提供任意配置文件。恶意用户或攻击者可以使用特制URL发送请求，这可能导致目录遍历攻击。</p><p style=\"text-align:start;text-indent:2em;\">Spring cloud Config已经出现过两次目录穿越漏洞，分别是CVE-2019-3799和CVE-2020-5405。</p>', '<p>1.建议受影响的用户升级至官方最新版本</p><p></p><p>2.未能及时安装新版的，可限制只允许可信源IP访问</p>', 'Any', NULL);
INSERT INTO `vulnerabilities` VALUES (1256, 'Jira ssrf (cve-2019-8451)', 'cve-2019-8451', NULL, 'high', '服务器端请求伪造', '<p>Jira的/plugins/servlet/gadgets/makeRequest资源存在SSRF漏洞，原因在于JiraWhitelist这个类的逻辑缺陷，成功利用此漏洞的远程攻击者可以以Jira服务端的身份访问内网资源。经分析，此漏洞无需任何凭据即可触发。</p>', '<p>1.建议受影响的用户升级至官方最新版本</p><p></p><p>2.未能及时安装新版的，可限制只允许可信源IP访问</p>', 'Any', NULL);
