INSERT INTO `vulnerabilities` VALUES (1258, 'ActiveMQ任意文件写入漏洞（CVE-2016-3088）', 'CVE-2016-3088', NULL, 'high', '任意文件写入', '<p>ActiveMQ 是 Apache 软件基金会下的一个开源消息驱动中间件软件。Jetty 是一个开源的 servlet 容器，它为基于 Java 的 web 容器，例如 JSP 和 servlet 提供运行环境。ActiveMQ 5.0 及以后版本默认集成了jetty。在启动后提供一个监控 ActiveMQ 的 Web 应用。<br/> 2016年4月14日，国外安全研究人员 Simon Zuckerbraun 曝光 Apache ActiveMQ Fileserver 存在多个安全漏洞，可使远程攻击者用恶意代码替代Web应用，在受影响系统上执行远程代码（CVE-2016-3088），漏洞影响版本：Apache ActiveMQ 5.x ~ 5.14.0。<br/><br/><br/>作者：Echocipher<br/>链接：https://www.jianshu.com/p/564fb8b54a67<br/>来源：简书<br/>著作权归作者所有。商业转载请联系作者获得授权，非商业转载请注明出处。</p>', '<p>1.建议受影响的用户升级至官方最新版本</p><p></p><p>2.未能及时安装新版的，可限制只允许可信源IP访问</p>', 'Any', NULL);
