INSERT INTO `vulnerabilities` VALUES (1261, '凡诺企业网站管理系统 v3 sql注入', NULL, NULL, 'high', 'SQL 注入', '<p>凡诺企业网站管理系统 v3 <span style=\"color:#333333\"><span style=\"font-size:16px\"><span style=\"background-color:#ffffff\">存在SQL注入漏洞，攻击者可利用漏洞获取数据库敏感信息。</span></span></span></p>', '<p>1.建议受影响的用户升级至官方最新版本</p><p></p><p>2.未能及时安装新版的，可限制只允许可信源IP访问</p>', 'Any', NULL);
INSERT INTO `vulnerabilities` VALUES (1262, 'Exchange Server SSRF (CVE-2021–26855)', NULL, NULL, 'high', '服务器端请求伪造', '<p style=\"text-align:left;text-indent:2em;\">Windows Exchange Server是国内外应用都非常广泛的邮件服务器，2021年03月3日，微软官方发布了Microsoft Exchange安全更新，并被黑客组织进行未授权RCE远程入侵利用。</p><p style=\"text-align:left;text-indent:2em;\">而CVE-2021-26855可以创建Exchange服务器端请求伪造（SSRF）漏洞，利用此攻击的攻击者能够发送任意HTTP请求并通过Exchange Server进行身份验证。</p>', '<p>1.建议受影响的用户升级至官方最新版本</p><p></p><p>2.未能及时安装新版的，可限制只允许可信源IP访问</p>', 'Any', NULL);
