INSERT INTO `vulnerabilities` VALUES (1264, '致远OA ajax 未授权', NULL, NULL, 'high', '未授权', '<p>致远OA ajax 未授权，结合文件上传可实现上传恶意脚本，从而控制服务器。</p>', '<p>1.建议受影响的用户升级至官方最新版本</p><p></p><p>2.未能及时安装新版的，可限制只允许可信源IP访问</p>', 'Any', NULL);
INSERT INTO `vulnerabilities` VALUES (1265, 'Saltstack 远程命令执行 (CVE-2020-16846)', NULL, NULL, 'high', '命令执行', '<p><span style=\"color:#555555\"><span style=\"font-size:18px\"><span style=\"background-color:#ffffff\">SaltStack 是基于 Python 开发的一套C/S架构配置管理工具。2020年11月SaltStack官方披露了CVE-2020-16846和CVE-2020-25592两个漏洞，其中CVE-2020-25592允许任意用户调用SSH模块，CVE-2020-16846允许用户执行任意命令。组合这两个漏洞，将可以使未授权的攻击者通过Salt API执行任意命令。</span></span></span></p>', '<p>1.建议受影响的用户升级至官方最新版本</p><p></p><p>2.未能及时安装新版的，可限制只允许可信源IP访问</p>', 'Any', NULL);
INSERT INTO `vulnerabilities` VALUES (1266, 'zabbix sql注入 (CVE-2016-10134)', NULL, NULL, 'high', 'SQL 注入', '<p>zabbix是一个基于WEB界面的提供分布式系统监视以及网络监视功能的企业级的开源解决方案。Zabbix 的latest.php中的toggle_ids[]或jsrpc.php种的profieldx2参数存在sql注入，通过sql注入获取管理员账户密码，进入后台，进行getshell操作。</p>', '<p>1.建议受影响的用户升级至官方最新版本</p><p></p><p>2.未能及时安装新版的，可限制只允许可信源IP访问</p>', 'Any', NULL);
INSERT INTO `vulnerabilities` VALUES (1267, 'PowerCreator CMS 文件上传getshell', NULL, NULL, 'high', '文件上传', '<p><span style=\"color:#333333\"><span style=\"font-size:15px\"><span style=\"letter-spacing:0.75px\"><span style=\"background-color:#ffffff\">PowerCreator CMS存在文件上传漏洞，攻击者可利用该漏洞获取网站服务器控制权。</span></span></span></span></p>', '<p>1.建议受影响的用户升级至官方最新版本</p><p></p><p>2.未能及时安装新版的，可限制只允许可信源IP访问</p>', 'Any', NULL);
INSERT INTO `vulnerabilities` VALUES (1268, 'Tomcat mod_jk访问控制绕过漏洞（CVE-2018-11759）', NULL, NULL, 'middle', '目录穿越', '<p style=\"text-align:justify;text-indent:2em;\">Apache Tomcat JK（mod_jk）Connector是美国阿帕奇（Apache）软件基金会的一款为Apache或IIS提供连接后台Tomcat的模块，它支持集群和负载均衡等。</p><p style=\"text-align:justify;text-indent:2em;\">Apache Tomcat JK（mod_jk）Connector 1.2.0版本至1.2.44版本中存在目录遍历漏洞。攻击者可利用该漏洞造成信息泄露。</p>', '<p>1.建议受影响的用户升级至官方最新版本</p><p></p><p>2.未能及时安装新版的，可限制只允许可信源IP访问</p>', 'Any', NULL);
