INSERT INTO `vulnerabilities` VALUES (1270, '智蜂网科技 ifw8 Router ROM 信息泄露漏洞', 'CVE-2019-16313', 'CNNVD-201909-707', 'middle', '信息泄漏', '<p><span style=\"color:#585858\"><span style=\"font-size:16px\"><span style=\"background-color:#ffffff\">智蜂网科技 ifw8 Router ROM是中国智蜂网科技公司的一套路由器操作系统。 智蜂网科技 ifw8 Router ROM v4.31版本中存在信息泄露漏洞。攻击者可通过读取action/usermanager.htm HTML源码利用该漏洞泄露凭证。</span></span></span></p>', '<p>1.建议受影响的用户升级至官方最新版本</p><p></p><p>2.未能及时安装新版的，可限制只允许可信源IP访问</p>', 'Any', NULL);
INSERT INTO `vulnerabilities` VALUES (1271, 'Jira 越权漏洞 (CVE-2019-8442)', 'CVE-2019-8442', 'CNNVD-201905-896', NULL, NULL, '<p>Atlassian Jira是澳大利亚Atlassian公司的一套缺陷跟踪管理系统。该系统主要用于对工作中各类问题、缺陷进行跟踪管理。 Atlassian Jira 7.13.4之前版本、8.0.4之前版本和8.1.1之前版本中的CachingResourceDownloadRewriteRule类存在安全漏洞。远程攻击者可利用该漏洞访问Jira webroot中的文件。</p><p><br/></p>', '<p>1.建议受影响的用户升级至官方最新版本</p><p></p><p>2.未能及时安装新版的，可限制只允许可信源IP访问</p>', 'Any', NULL);
