INSERT INTO `vulnerabilities` VALUES (1276, 'QNAP Systems Photo Station 访问控制错误漏洞', 'CVE-2019-7192', 'CNNVD-201912-239', 'middle', '未授权', '<p>QNAP Systems Photo Station是中国威联通（QNAP Systems）公司的一款照片管理和查看应用程序。 QNAP Systems Photo Station中存在访问控制错误漏洞。远程攻击者可利用该漏洞对系统进行未经授权的访问。以下产品及版本受到影响：QNAP Systems Photo Station 6.0.3之前版本（QTS 4.4.1版本），5.7.10之前版本（QTS 4.3.4版本至4.4.0版本），5.4.9之前版本（QTS 4.3.0版本至4.3.3版本），5.2.11之前版本（QTS 4.2.6版本）。</p>', '<p>1.建议受影响的用户升级至官方最新版本</p><p></p><p>2.未能及时安装新版的，可限制只允许可信源IP访问</p>', 'Any', NULL);
INSERT INTO `vulnerabilities` VALUES (1278, 'ECShop 2.x/3.x 任意代码执行漏洞', NULL, NULL, 'high', '命令执行', '<p style=\"text-align:start;text-indent:2em;\">ECShop是一款B2C独立网店系统，适合企业及个人快速构建个性化网上商店。系统是基于PHP语言及MYSQL数据库构架开发的跨平台开源程序。</p><p style=\"text-align:start;text-indent:2em;\">其2017年及以前的版本中，存在一处SQL注入漏洞，通过该漏洞可注入恶意数据，最终导致任意代码执行漏洞。其3.6.0最新版已修复该漏洞，vulhub中使用其2.7.3最新版与3.6.0次新版进行漏洞复现。</p>', '<p>1.建议受影响的用户升级至官方最新版本</p><p></p><p>2.未能及时安装新版的，可限制只允许可信源IP访问</p>', 'Any', NULL);
INSERT INTO `vulnerabilities` VALUES (1279, 'Confluence 信息泄露漏洞 (CVE-2015-8399)', 'CVE-2015-8399', 'CNNVD-201601-311', 'middle', '信息泄漏', '<p>AtlassianConfluence是澳大利亚Atlassian公司的一套专业的企业知识管理与协同软件，也可以用于构建企业WiKi。该软件可实现团队成员之间的协作和知识共享。AtlassianConfluence5.8.17之前版本中存在安全，该漏洞源于spaces/viewdefaultdecorator.action和admin/viewdefaultdecorator.action文件没有充分过滤‘decoratorName’参数。远程攻击者可利用该漏洞读取配置文件。</p><p><br/></p>', '<p>1.建议受影响的用户升级至官方最新版本</p><p></p><p>2.未能及时安装新版的，可限制只允许可信源IP访问</p>', 'Any', NULL);
INSERT INTO `vulnerabilities` VALUES (1280, 'Openfire 远程代码执行', 'CVE-2019-18394', 'CNNVD-201910-1465', 'high', NULL, '<p>Ignite Realtime Openfire是Ignite Realtime社区的一款采用Java开发且基于XMPP（前称Jabber，即时通讯协议）的跨平台开源实时协作（RTC）服务器，它能够构建高效率的即时通信服务器，并支持上万并发用户数量。 Ignite Realtime Openfire 4.4.2及之前版本中的FaviconServlet.java文件存在代码问题漏洞。该漏洞源于网络系统或产品的代码开发过程中存在设计或实现不当的问题。</p><p><br/></p>', '<p>1.建议受影响的用户升级至官方最新版本</p><p></p><p>2.未能及时安装新版的，可限制只允许可信源IP访问</p>', 'Any', NULL);
INSERT INTO `vulnerabilities` VALUES (1281, 'zabbix 登录绕过', NULL, NULL, 'high', '权限提升', '<p>发现zabbix 登录可绕过</p>', '<p>1.建议受影响的用户升级至官方最新版本</p><p></p><p>2.未能及时安装新版的，可限制只允许可信源IP访问</p>', 'Any', NULL);
INSERT INTO `vulnerabilities` VALUES (1282, '用友 NC 任意文件上传漏洞', NULL, NULL, 'high', '文件上传', '<p style=\"text-align:left;text-indent:2em;\">用友NC是一款企业级管理软件，在大中型企业广泛使用。实现建模、开发、继承、运行、管理一体化的IT解决方案信息化平台。用友NC 为C/S 架构，使用JAVA编程语言开发，客户端可直接使用UClient，服务端接口为HTTP。</p><p style=\"text-align:left;text-indent:2em;\">用友NC6.5的某个页面，存在任意文件上传漏洞。漏洞成因在于上传文件处未作类型限制，未经身份验证的攻击者可通过向目标系统发送特制数据包来利用此漏洞，成功利用此漏洞的远程攻击者可在目标系统上传任意文件执行命令。</p>', '<p>1.建议受影响的用户升级至官方最新版本</p><p></p><p>2.未能及时安装新版的，可限制只允许可信源IP访问</p>', 'Any', NULL);
INSERT INTO `vulnerabilities` VALUES (1283, 'UEditer .net版本 任意文件上传', NULL, NULL, 'high', NULL, '<p>百度UEditor是由百度web前端研发部开发所见即所得富文本web编辑器，具有轻量，可定制，注重用户体验等特点。Ueditor编辑器.net版本存在任意文件上传漏洞，攻击者可精心构造环境上传文件，获取服务器管理权限。</p>', '<p>1.建议受影响的用户升级至官方最新版本</p><p></p><p>2.未能及时安装新版的，可限制只允许可信源IP访问</p>', 'Any', NULL);
INSERT INTO `vulnerabilities` VALUES (1284, 'Harbor 越权创建管理员', 'CVE-2019-16097', 'CNNVD-201909-292', 'high', '权限提升', '<p>Harbor是一款开源的可信云本机注册表。该产品主要用于存储、签名和扫描容器映像以查找漏洞。 Harbor 1.7.0版本至1.8.2版本中的core/api/user.go文件存在权限许可和访问控制问题漏洞。攻击者可利用该漏洞创建admin账户。</p>', '<p>1.建议受影响的用户升级至官方最新版本</p><p></p><p>2.未能及时安装新版的，可限制只允许可信源IP访问</p>', 'Any', NULL);
INSERT INTO `vulnerabilities` VALUES (1285, 'Jumpserver 未授权RCE', NULL, NULL, 'high', '命令执行', '<p>JumpServer 是全球首款开源的堡垒机，使用 GNU GPL v2.0 开源协议，是符合 4A 规范的运维安全审计系统。JumpServer 使用 Python / Django 为主进行开发，遵循 Web 2.0 规范，配备了业界领先的 Web Terminal 方案，交互界面美观、用户体验好。JumpServer 采纳分布式架构，支持多机房跨区域部署，支持横向扩展，无资产数量及并发限制。</p><p style=\"text-align:start;text-indent:2em;\">由于 JumpServer 某些接口未做授权限制，攻击者可构造恶意请求从日志文件获取敏感信息，或者执行相关API操作控制其中所有机器，执行任意命令。</p><p></p>', '<p>1.建议受影响的用户升级至官方最新版本</p><p></p><p>2.未能及时安装新版的，可限制只允许可信源IP访问</p>', 'Any', NULL);
INSERT INTO `vulnerabilities` VALUES (1286, '通达OA 会议通知信息 越权访问', NULL, NULL, 'middle', '信息泄漏', '<p>通达OA系统低于11.5 存在会议通知信息越权访问</p>', '<p>1.建议受影响的用户升级至官方最新版本</p><p></p><p>2.未能及时安装新版的，可限制只允许可信源IP访问</p>', 'Any', NULL);
INSERT INTO `vulnerabilities` VALUES (1287, 'Tomcat 远程代码执行 (CVE-2017-12615)', 'CVE-2017-12615', NULL, 'high', '命令执行', '<p><span style=\"color:#333333\"><span style=\"font-size:15px\"><span style=\"letter-spacing:0.75px\"><span style=\"background-color:#ffffff\">2017年9月19日，Apache Tomcat官方确认并修复了两个高危漏洞，漏洞CVE编号:CVE-2017-12615和CVE-2017-12616,该漏洞受影响版本为7.0-7.80之间，在一定条件下，攻击者可以利用这两个漏洞，获取用户服务器上 JSP 文件的源代码，或是通过精心构造的攻击请求，向用户服务器上传恶意JSP文件，通过上传的 JSP 文件 ，可在用户服务器上执行任意代码，从而导致数据泄露或获取服务器权限，存在高安全风险。</span></span></span></span></p>', '<p>1.建议受影响的用户升级至官方最新版本</p><p></p><p>2.未能及时安装新版的，可限制只允许可信源IP访问</p>', 'Any', NULL);
INSERT INTO `vulnerabilities` VALUES (1288, '五指CMS v410 sql注入', NULL, NULL, 'high', '命令执行', '<p><span style=\"color:#333333\"><span style=\"font-size:16px\"><span style=\"background-color:#ffffff\">五指CMS v410 存在SQL注入漏洞，攻击者可利用漏洞获取数据库敏感信息。</span></span></span></p>', '<p>1.建议受影响的用户升级至官方最新版本</p><p></p><p>2.未能及时安装新版的，可限制只允许可信源IP访问</p>', 'Any', NULL);
INSERT INTO `vulnerabilities` VALUES (1289, 'Solr via-Velocity-template 远程命令执行', NULL, NULL, 'high', '命令执行', '<ol><li>当攻击者可以直接访问Solr控制台时，可以通过发送类似/节点名/config的POST请求对该节点的配置文件做更改。</li><li>Apache Solr默认集成VelocityResponseWriter插件，在该插件的初始化参数中的params.resource.loader.enabled这个选项是用来控制是否允许参数资源加载器在Solr请求参数中指定模版，默认设置是false。当设置params.resource.loader.enabled为true时，将允许用户通过设置请求中的参数来指定相关资源的加载，这也就意味着攻击者可以通过构造一个具有威胁的攻击请求，在服务器上进行命令执行。</li></ol>', '<p>1.建议受影响的用户升级至官方最新版本</p><p></p><p>2.未能及时安装新版的，可限制只允许可信源IP访问</p>', 'Any', NULL);
INSERT INTO `vulnerabilities` VALUES (1290, 'YCCms v3.3 远程命令执行', NULL, NULL, 'high', '命令执行', '<p>YCCms v3.3 远程命令执行</p>', '<p>1.建议受影响的用户升级至官方最新版本</p><p></p><p>2.未能及时安装新版的，可限制只允许可信源IP访问</p>', 'Any', NULL);
