INSERT INTO `vulnerabilities` VALUES (1292, '齐博cms sql注入', NULL, NULL, 'high', 'SQL 注入', '<p>齐博cms sql注入</p>', '<p>1.建议受影响的用户升级至官方最新版本</p><p></p><p>2.未能及时安装新版的，可限制只允许可信源IP访问</p>', 'Any', NULL);
INSERT INTO `vulnerabilities` VALUES (1293, 'Supervisor XML-RPC 远程命令执行', 'CVE-2017-11610', 'CNNVD-201707-1129', 'high', '命令执行', '<p>Supervisor是一套进程控制系统，用于监视和控制类Unix系统上的进程。XML-RPC server是其中的一个XML-RPC服务器。 Supervisor中的XML-RPC服务器存在安全漏洞。远程攻击者可借助特制的XML-RPC请求利用该漏洞执行任意命令。以下版本受到影响：supervisor 3.0.1之前的版本，3.1.4之前的3.1.x版本，3.2.4之前的3.2.x版本，3.3.3之前的3.3.x版本。</p><p><br/></p>', '<p>1.建议受影响的用户升级至官方最新版本</p><p></p><p>2.未能及时安装新版的，可限制只允许可信源IP访问</p>', 'Any', NULL);
INSERT INTO `vulnerabilities` VALUES (1294, 'vCenter 6.5-7.0 远程命令执行 (CVE-2021-21972)', 'CVE-2021-2197', NULL, 'high', '命令执行', '<p style=\"text-align:start;text-indent:2em;\">vCenter Server 为 ESXi 的控制中心，可从单一控制点统一管理数据中心的所有 vSphere 主机和虚拟机。</p><p style=\"text-align:start;text-indent:2em;\">CVE-2021-21972 是Vcenter的一个未授权文件上传漏洞。该漏洞可以上传文件至vcenter服务器的任意位置。由于该服务System权限，可以任意写，可上传webshell并执行，如果是Linux环境并开放了ssh，可上传公钥直接通过ssh登录。</p>', '<p>1.建议受影响的用户升级至官方最新版本</p><p></p><p>2.未能及时安装新版的，可限制只允许可信源IP访问</p>', 'Any', NULL);
INSERT INTO `vulnerabilities` VALUES (1295, 'NexusDB 目录穿越', 'CVE-2020-24571', 'CNNVD-202008-1090', 'middle', '目录穿越', '<p>NexusDB 目录穿越</p>', '<p>1.建议受影响的用户升级至官方最新版本</p><p></p><p>2.未能及时安装新版的，可限制只允许可信源IP访问</p>', 'Any', NULL);
INSERT INTO `vulnerabilities` VALUES (1296, 'PHPUnit 远程命令执行', 'CVE-2017-9841', 'CNNVD-201706-1127', 'middle', '命令执行', '<p>TYPO3是瑞士TYPO3协会维护的一套免费开源的内容管理系统。PHPUnit是其中的一个基于PHP的测试框架。 PHPUnit 4.8.28之前的版本和5.6.3之前的5.x版本中的Util/PHP/eval-stdin.php文件存在安全漏洞。远程攻击者可通过发送以‘＜?php’字符串开头的HTTP POST数据利用该漏洞执行任意PHP代码。</p><p><br/></p>', '<p>1.建议受影响的用户升级至官方最新版本</p><p></p><p>2.未能及时安装新版的，可限制只允许可信源IP访问</p>', 'Any', NULL);
INSERT INTO `vulnerabilities` VALUES (1297, 'Couchcms 2.0 存在路径泄露漏洞', 'CVE-2018-7662', NULL, 'middle', '信息泄漏', '<p style=\"text-align:start;text-indent:2em;\">Couch through 2.0存在路径泄露漏洞，当访问特定url时系统返回的报错信息中暴露物理路径信息。</p>', '<p>1.建议受影响的用户升级至官方最新版本</p><p></p><p>2.未能及时安装新版的，可限制只允许可信源IP访问</p>', 'Any', NULL);
INSERT INTO `vulnerabilities` VALUES (1298, '海康威视 Cameras 敏感信息泄露', 'CVE-2017-7921', 'CNNVD-201704-1049', NULL, '信息泄漏', '<p>HikvisionDS-2CD2xx2F-ISeries等都是中国海康威视（Hikvision）公司的网络摄像头产品。多款Hikvision产品中存在身份验证漏洞。攻击者可利用该漏洞提升权限，获取敏感信息的访问权限。以下产品和版本受到影响：HikvisionDS-2CD2xx2F-ISeries5.2.0build140721版本至5.4.0build160530版本；DS-2CD2xx0F-ISeries5.2.0build140721版本至5.4.0Build160401版本；DS-2CD2xx2FWDSeries5.3.1build150410版本至5.4.4Build161125版本；DS-2CD4x2xFWDSeries5.2.0build140721版本至5.4.0Build160414版本；DS-2CD4xx5Series5.2.0build140721版本至5.4.0Build160421版本；DS-2DFxSeries5.2.0build140805版本至5.4.5Build160928版本；DS-2CD63xxSeries5.0.9build140305版本至5.3.5Build160106版本。</p><p></p>', '<p>1.建议受影响的用户升级至官方最新版本</p><p></p><p>2.未能及时安装新版的，可限制只允许可信源IP访问</p>', 'Any', NULL);
